INSERT INTO `wp_posts` VALUES (2,1,'2011-02-13 23:10:38','2011-02-13 23:10:38','<h3>Welcome to the Chelsea and Fulham Sub-Aqua Club.</h3>\r\nWe are a small, friendly club with about 45 members. We were founded back in the 1950\'s and are branch No. 45 of the British Sub-Aqua Club (BSAC). Our members cover a wide range of ages but are predominantly in their 30\'s and 40\'s and we probably have one of the highest percentages of female divers in the area.\r\n\r\nWithin the club there is a wealth of diving experience, ranging from qualified instructors, advanced divers and dive leaders, to those who are just beginning.\r\n\r\nDuring the summer months, we enjoy regular weekend trips to the coast, descending to 30 metres and having a mooch around the wrecks and checking out the marine life.\r\n\r\nThe club has excellent relationships with some of the best dive charters on the south coast and we hire hard boats for the weekend diving activities throughout the summer.\r\n<h3>Location</h3>\r\nCharing Cross Hospital Social Club, Aspenlea Road, W6 8LH\r\n\r\nWe meet every Thursday night at the Charing Cross Hospital Social Club, on Aspenlea Road, also accessible from Fulham Palace Road, near Hammersmith, London.\r\n\r\nWe have the use of the four metre deep pool from 8:30 p.m on Thursday.\r\n\r\nAfter pool sessions we can usually be found at The Pear Tree: 14 Margravine Road, London W6 8HJ.\r\n<h3>Nearest Underground Stations</h3>\r\nBarons Court\r\n\r\nHammersmith\r\n<h3>Parking</h3>\r\nVehicles can be parked inside the Charing Cross hospital grounds @ about 2.00 per hour. (free after 9pm)\r\n\r\nThere is free street parking in Aspenlea Road after 5.30 p.m.','About','','publish','closed','closed','','about','','','2016-07-13 10:15:34','2016-07-13 10:15:34','',0,'http://localhost/wordpress/?page_id=2',0,'page','',0),(4,1,'2011-02-13 23:56:01','2011-02-13 23:56:01','http://localhost/wordpress/wp-content/uploads/2011/02/photo_1_753537f9a90234ee9d34b90c982c7660.jpg','photo_1_753537f9a90234ee9d34b90c982c7660.jpg','','inherit','open','open','','photo_1_753537f9a90234ee9d34b90c982c7660-jpg','','','2011-02-13 23:56:01','2011-02-13 23:56:01','',0,'http://localhost/wordpress/wp-content/uploads/2011/02/photo_1_753537f9a90234ee9d34b90c982c7660.jpg',0,'attachment','image/jpeg',0),(5,1,'2011-02-14 00:04:51','2011-02-14 00:04:51','http://localhost/wordpress/wp-content/uploads/2011/02/ocean-wallpapers_26256_1920x1080.jpg','ocean-wallpapers_26256_1920x1080.jpg','','inherit','open','open','','ocean-wallpapers_26256_1920x1080-jpg','','','2011-02-14 00:04:51','2011-02-14 00:04:51','',0,'http://localhost/wordpress/wp-content/uploads/2011/02/ocean-wallpapers_26256_1920x1080.jpg',0,'attachment','image/jpeg',0),(8,1,'2011-02-14 00:22:19','2011-02-14 00:22:19','This is an example of a WordPress page, you could edit this to put information about yourself or your site so readers know where you are coming from. You can create as many pages like this one or sub-pages as you like and manage all of your content inside of WordPress.','About Us','','publish','closed','closed','','8','','','2016-07-13 10:24:52','2016-07-13 10:24:52','',0,'http://localhost/wordpress/?p=8',6,'nav_menu_item','',0),(12,1,'2011-02-14 00:41:34','2011-02-14 00:41:34','Date: TBC\r\n\r\nA great way to start the season. Depending on demand, either the Saturday or Sunday will be chosen. Entry fee will be paid for by the club so its <strong>Free</strong>. Come along to give yourself and your kit a shake down after the winter, practice some skills, try new kit that Santa delivered or request some training from an instructor. Hopefully the club will be offering two dates so all members can make use of this opportunity.\r\n\r\nNote: Only one day will be paid for by the club, if you dive on the second day you will need to cover your own entry fee.','April - 2011 - Stoney Cove','','publish','closed','closed','','april-stoney-cove','','','2012-01-07 10:07:28','2012-01-07 10:07:28','',0,'http://localhost/wordpress/?p=12',0,'post','',0),(17,1,'2011-02-14 00:47:06','2011-02-14 00:47:06','','Stoney Cove','','inherit','closed','closed','','n503917490_1104883_9384','','','2011-02-14 00:47:06','2011-02-14 00:47:06','',12,'http://localhost/wordpress/wp-content/uploads/2011/02/n503917490_1104883_9384.jpg',0,'attachment','image/jpeg',0),(20,1,'2011-02-14 00:54:43','2011-02-14 00:54:43','','Home','','publish','closed','closed','','home-2','','','2016-07-13 10:24:52','2016-07-13 10:24:52','',0,'http://localhost/wordpress/?p=20',1,'nav_menu_item','',0),(22,1,'2011-02-14 01:01:13','2011-02-14 01:01:13','Date: 14th May 2011\r\n\r\nA one day trip (Saturday only) and another early season warm up dive. Great if you dont have the time to commit to a whole weekend away and easy to get to from London. Boat looks fab, take a look at <a href=\"http://www.channeldiving.com/\">www.channeldiving.com</a>. Cost for the boat is 54.','May - 2011 - Brighton','','publish','closed','closed','','may-brighton','','','2012-01-07 10:07:37','2012-01-07 10:07:37','',0,'http://localhost/wordpress/?p=22',0,'post','',0),(23,1,'2011-02-14 00:59:58','2011-02-14 00:59:58','','OLYMPUS DIGITAL CAMERA','','inherit','closed','closed','','olympus-digital-camera','','','2011-02-14 00:59:58','2011-02-14 00:59:58','',22,'http://localhost/wordpress/wp-content/uploads/2011/02/CD22.jpg',0,'attachment','image/jpeg',0),(29,1,'2011-02-14 01:19:25','2011-02-14 01:19:25','Date: 4/5th June 2011\r\n\r\nDive Time is booked again  its the big yellow boat with the chilled out skipper. Aiming to do some quality wrecks and pretty drifts with a high chance of a haul of scallops. Kit can be left onboard overnight. Accommodation will be booked for Friday/Saturday at the Bunker. Boat is 49 per day inc. fabulous homemade soup lunch. B&amp;B is expected to be 22 per night or you can bring your own sleeping bag/pillow and self cater for 13. Dinner is approx. 12 on the Saturday night  last year we self-served for dinner and it worked well.','June - 2011 - Weymouth','','publish','closed','closed','','june-weymouth','','','2012-01-07 10:07:46','2012-01-07 10:07:46','',0,'http://localhost/wordpress/?p=29',0,'post','',0),(30,1,'2011-02-14 01:19:03','2011-02-14 01:19:03','','DT10','','inherit','closed','closed','','dt10','','','2011-02-14 01:19:03','2011-02-14 01:19:03','',29,'http://localhost/wordpress/wp-content/uploads/2011/02/DT10.jpg',0,'attachment','image/jpeg',0),(35,1,'2011-02-14 01:20:50','2011-02-14 01:20:50','http://localhost/wordpress/wp-content/uploads/2011/02/Ocean.jpg','Ocean.jpg','','inherit','closed','closed','','ocean-jpg','','','2011-02-14 01:20:50','2011-02-14 01:20:50','',0,'http://localhost/wordpress/wp-content/uploads/2011/02/Ocean.jpg',0,'attachment','image/jpeg',0),(42,1,'2011-02-14 02:15:15','2011-02-14 02:15:15','Date: 25/26th June 2011\r\n\r\nA new boat to most of the club  Beowulf with its skipper Pete. Diving from Poole harbour it is an easily accessible trip from London. From Poole you can head west towards Swanage &amp; Weymouth or east towards Southampton and the Isle of Wight. A HUGE boat with a friendly skipper. Easy boat loading, cheap parking on Saturday and free on Sunday ! The diving will be getting towards the 30mtr mark so suitable for Sports Divers and above. The boat cost is 45 per day and kit can be left on overnight. Accommodation: It is likely that those booking onto the trip will be responsible for booking their own accommodation.','June - 2011  Poole','','publish','closed','closed','','june-%e2%80%93-poole','','','2012-01-07 10:07:56','2012-01-07 10:07:56','',0,'http://localhost/wordpress/?p=42',0,'post','',0),(45,1,'2011-02-14 02:21:42','2011-02-14 02:21:42','','AeolianSky','','inherit','closed','closed','','aeoliansky','','','2011-02-14 02:21:42','2011-02-14 02:21:42','',42,'http://localhost/wordpress/wp-content/uploads/2011/02/AeolianSky.jpg',0,'attachment','image/jpeg',0),(47,1,'2011-02-14 02:25:21','2011-02-14 02:25:21','Date: 23/24th July 2011\r\n\r\nIts time to visit Swanage in better weather than previous years. Like Poole, the diving will be at the deeper end of the scale. We have the charter boat Sidewinder booked so kit can be left on between dives but the boat does come back to the pier. Boat is 45 per day. Accommodation will be booked to suit those on the trip and will be in the 30 region for B&amp;B.','July - 2011  Swanage','','publish','closed','closed','','july-%e2%80%93-swanage','','','2012-01-07 10:08:04','2012-01-07 10:08:04','',0,'http://localhost/wordpress/?p=47',0,'post','',0),(48,1,'2011-02-14 02:25:05','2011-02-14 02:25:05','','swanage-pier','','inherit','closed','closed','','swanage-pier','','','2011-02-14 02:25:05','2011-02-14 02:25:05','',47,'http://localhost/wordpress/wp-content/uploads/2011/02/swanage-pier.jpg',0,'attachment','image/jpeg',0),(53,1,'2011-02-14 02:30:37','2011-02-14 02:30:37','Date: 20/23rd August 2011\r\n\r\nFour days diving (Sat, Sun, Mon, Tue) down on the Lizard Peninsular where there are Jewel Anemones in abundance and the chance of sighting a Basking Shark. The smaller hardboat Celtic Kitten has been booked at 40 per person. After the success of staying at Parcen Grouse, the club is about to secure accommodation there again for this trip. If anyone is contemplating making this a longer trip and would have different accommodation requirements, please let us know. Camping is also available right next door.','August - 2011  Porthkerris','','publish','closed','closed','','august-%e2%80%93-porthkerris','','','2012-01-07 10:08:12','2012-01-07 10:08:12','',0,'http://localhost/wordpress/?p=53',0,'post','',0),(54,1,'2011-02-14 02:30:05','2011-02-14 02:30:05','','320538_99d9628f','','inherit','closed','closed','','320538_99d9628f','','','2011-02-14 02:30:05','2011-02-14 02:30:05','',53,'http://localhost/wordpress/wp-content/uploads/2011/02/320538_99d9628f.jpg',0,'attachment','image/jpeg',0),(58,1,'2011-02-14 02:37:00','2011-02-14 02:37:00','Date: 16/18th September 2011\r\n\r\nThree days diving (Fri, Sat, Sun) with the potential to put a day in St Abbs either end of the trip if people are up for it. A different boat from previous years  Glad Tidings, complete with a diver lift. Cost is 40 per day  you have to provide your own lunch; the bakers in Seahouses is fab. Accommodation will be booked at <a href=\"http://www.springhill-farm.co.uk/\">Springhill Farm</a>. There is a bunk house plus the option of families to book a cottage or a wigwam. Bunkhouse is 14 per night (breakfast not included and will be self catering), wigwams are 19 per person and sleep a max of 5 plus there is a camping option. PLEASE INDICATE ACCOMMODATION REQUIREMENTS ASAP. There is alternative en-suite B&amp;B accommodation available at a different location for 35 pppn.','September - 2011 - Farne Islands','','publish','closed','closed','','september-farne-islands','','','2012-01-07 10:08:24','2012-01-07 10:08:24','',0,'http://localhost/wordpress/?p=58',0,'post','',0),(59,1,'2011-02-14 02:36:03','2011-02-14 02:36:03','','10629_178628729749_725254749_3698219_6445936_n','','inherit','closed','closed','','10629_178628729749_725254749_3698219_6445936_n','','','2011-02-14 02:36:03','2011-02-14 02:36:03','',58,'http://localhost/wordpress/wp-content/uploads/2011/02/10629_178628729749_725254749_3698219_6445936_n.jpg',0,'attachment','image/jpeg',0),(61,1,'2011-02-14 02:39:12','2011-02-14 02:39:12','Date: 15/16th October 2011\r\n\r\nBecoming a club favourite for late season diving, we have booked Loyal Watcher again to go diving in Plymouth.  The diving is well worth the trip down the M5.  Dont be put off by it being late in the year, the seas are probably at their warmest, the visibility can be excellent and the Loyal Watcher is a very stable boat that can get out in weathers that others refuse (and its stable when it is out!).  The package is all inclusive of boat, accommodation, brekkies, lunch, dinner (both Saturday and Sunday), air &amp; parking  only the beer is extra.  All at 92 per day and the only trip where only ONE cylinder is required.','October - 2011 - Plymouth','','publish','closed','closed','','october-plymouth','','','2012-01-07 10:08:32','2012-01-07 10:08:32','',0,'http://localhost/wordpress/?p=61',0,'post','',0),(62,1,'2011-02-14 02:38:54','2011-02-14 02:38:54','','Plymouth','','inherit','closed','closed','','plymouth','','','2011-02-14 02:38:54','2011-02-14 02:38:54','',61,'http://localhost/wordpress/wp-content/uploads/2011/02/Plymouth.jpg',0,'attachment','image/jpeg',0),(71,1,'2011-02-14 04:45:04','2011-02-14 04:45:04','<h2><strong>Learning to dive with Chelsea and Fulham Sub Aqua Club:</strong></h2>\r\n<h3>Ocean Diver</h3>\r\nOcean Diver is the BSAC beginners course for learning to dive. The course provides you with the essential knowledge and skills needed to prepare for open water diving. Learning to dive is all about learning to use your equipment properly and safely, learning safety skills, signals to communicate with your buddy etc. The Ocean Diver training course concentrates on preparing you for open water in the safety of a swimming pool or sheltered water and then introducing you to open water in a controlled and safe manner. Training is always done in the company of a qualified instructor or experienced diver.\r\n\r\nThe BSAC Ocean Diver Course includes a basic swimming assessment, seven theory lessons, approximately ten practical lessons and practice sessions in a swimming pool, five open water dives and a theory assessment.\r\n\r\nAfter successful completion of the Ocean Diver qualification, you will be qualified to dive to a maximum depth of 20m.\r\n\r\nPool training starts at 8:30 pm on Thursday evening. We are very flexible in our training and can start courses whenever necessary.\r\n<h3>Sports Diver</h3>\r\nThis course is designed to develop divers beyond the basics learned during the Ocean Diver course. The emphasis is on building a solid foundation of open water diving skills and experience through a series of structured practical lessons under the guidance of a qualified instructor.\r\n\r\nOnce this qualification has been obtained divers can follow a progressive build up to a depth of 35m.\r\n<h3>Dive Leader</h3>\r\nFollowing successful completion of the Sports Diver qualification, divers can begin training for the Dive Leader qualification. This looks at the responsibilities and safety aspects of leading other divers on open water dives. During the practical lessons, you will learn rescue management techniques and rescue skills that will give you the confidence and ability to deal with unforeseen emergencies.\r\n\r\nOnce this qualification has been obtained divers can follow a progressive build up to a depth of 50m.\r\n<h3>Become an Instructor</h3>\r\nSeveral of our divers have continued their training and become instructors or assistant instructors. If you are an experienced diver and would like to develop teaching skills we will be happy to help you achieve your instructor qualifications.','Learn to Dive','','publish','closed','closed','','learn-to-dive','','','2016-07-13 10:19:21','2016-07-13 10:19:21','',0,'http://cfsac.byethost3.com/?page_id=71',0,'page','',0),(74,1,'2011-02-14 04:45:48','2011-02-14 04:45:48','Learning to dive with Chelsea and Fulham Sub Aqua Club: Ocean Diver Ocean Diver is the BSAC beginners course for learning to dive. The course provides you with the essential knowledge and skills needed to prepare for open water diving. Learning to dive is all about learning to use your equipment properly and safely, learning safety skills, signals to communicate with your buddy etc. The Ocean Diver training course concentrates on preparing you for open water in the safety of a swimming pool or sheltered water and then introducing you to open water in a controlled and safe manner. Training is always done in the company of a qualified instructor or experienced diver. The BSAC Ocean Diver Course includes a basic swimming assessment, seven theory lessons, approximately ten practical lessons and practice sessions in a swimming pool, five open water dives and a theory assessment. After successful completion of the Ocean Diver qualification, you will be qualified to dive to a maximum depth of 20m. Pool training starts at 9:00 pm on Thursday evening. We are very flexible in our training and can start courses whenever necessary. Sports Diver This course is designed to develop divers beyond the basics learned','','','publish','closed','closed','','74','','','2016-07-13 10:24:52','2016-07-13 10:24:52','',0,'http://cfsac.byethost3.com/?p=74',4,'nav_menu_item','',0),(75,1,'2011-02-14 05:21:40','2011-02-14 05:21:40','<h3>Joining</h3>\r\nJoining the Chelsea and Fulham Sub-Aqua Club is easy, whether you are new to the sport, want to continue your training, or are already qualified and want to go diving with a club.\r\n\r\nContact us, details below, and they will arrange for you to come to a pool session on a club night. We\'ll take you for a swim or a \'try dive\', introduce you to some of the members and finish off with a pint in the bar. If you would like to join us, then its as simple as completing some paperwork.\r\n<h3>Qualified Member</h3>\r\nThe fee is 107.50. This includes 50 per year membership to CFSAC (Chelsea and Fulham Sub-Aqua Club) and 57.50 for annual BSAC (British Sub Aqua Club) membership.\r\n<h3>Trainee</h3>\r\nThe fee is 202.50. This is the total for a new diver and includes: 100 for the first year of membership to CFSAC (Chelsea and Fulham Sub-Aqua Club), 57.50 for annual BSAC (British Sub Aqua Club) membership and 45 for books, log book etc.\r\n<h3>Additional Information</h3>\r\nFor a diver continuing membership for a second year, the club fees are reduced to 50 per year. The reason the first year is more expensive is to cover the cost of equipment hire maintenance and servicing, air fills and training. It is assumed that by the second year you will have bought at least some of your own equipment and so the club fees are reduced to take this into account.\r\n\r\nStudent members and instructors may be eligible for a discount on their BSAC membership fees. Student fees are currently 29.50 per year and instructor fees are 52.50 per year.\r\n<h3>Contact Us</h3>\r\nDave Bennett (Training Officer)\r\n\r\n07905916821\r\n<a href=\"mailto:contactcfsac@gmail.com\">contactcfsac@gmail.com</a>','Join CFSAC','','publish','closed','closed','','join-cfsac','','','2017-12-03 18:43:30','2017-12-03 18:43:30','',0,'http://cfsac.byethost3.com/?page_id=75',0,'page','',0),(84,1,'2011-02-14 05:25:32','2011-02-14 05:25:32','Joining Joining the Chelsea and Fulham Sub-Aqua Club is easy, whether you are new to the sport, want to continue your training, or are already qualified and want to go diving with a club. Contact Frances Williams, details below, and she will arrange for you to come to a pool session on a club night. Well take you for a swim or a try dive, introduce you to some of the members and finish off with a pint in the bar. If you would like to join us, then its as simple as completing some paperwork and parting with a cheque. Qualified Member The fee is 110. This includes 60 per year membership to CFSAC (Chelsea and Fulham Sub-Aqua Club) and 50 for annual BSAC (British Sub Aqua Club) membership. Trainee The fee is 187. This is the total for a new diver and includes: 100 for the first year of membership to CFSAC (Chelsea and Fulham Sub-Aqua Club), 50 for annual BSAC (British Sub Aqua Club) membership and 37 for books, log book etc. Additional Information For a diver continuing membership for a second year, the club fees are reduced to 50 per year. The reason the first year','','','publish','closed','closed','','84','','','2016-07-13 10:24:52','2016-07-13 10:24:52','',0,'http://cfsac.byethost3.com/?p=84',5,'nav_menu_item','',0),(93,1,'2011-01-15 16:51:22','2011-01-15 16:51:22','One of the things that makes our club great (aside from the people, that is) is the fact that we have this FANTASTIC pool to train in. We want to encourage you all to make the most of this facility, so we are running a series of themed evenings in the run up to the beginning of the dive season.\r\n\r\nThese fortnightly events will focus on skills and training and will provide you with the opportunity to try out some of those things that you might feel a bit rusty on.\r\n\r\n17th February 2011 - General kit checking to test out any new (or old) kit\r\n3rd March 2011 - Buoyancy workshop to try out some underwater obstacles\r\n17th March 2011 - Rescue skills refresher Brush up on your rescue skills and remind yourself on those all important procedures\r\n31st March 2011 -  Basics skills refresher Mask loss, Alternative Source donation, DSMB deployment','February and March - 2011 - Themed Pool Sessions','','publish','closed','closed','','february-and-march-themed-pool-sessions','','','2012-01-07 10:07:12','2012-01-07 10:07:12','',0,'http://cfsac.byethost3.com/?p=93',0,'post','',0),(94,1,'2011-02-15 16:50:37','2011-02-15 16:50:37','','martins1','','inherit','closed','closed','','martins1','','','2011-02-15 16:50:37','2011-02-15 16:50:37','',93,'http://cfsac.byethost3.com/wp-content/uploads/2011/02/martins1.jpeg',0,'attachment','image/jpeg',0),(96,1,'2011-01-18 19:19:01','2011-01-18 19:19:01','CFSAC has a stand at this years Big Scuba Show! We\'ll be over in the BSAC Branch Pods which are situated next to the BSAC Stand (490).\r\n\r\nPop by for a chat, to hear more about the club or to join CFSAC!\r\n\r\nThe club is running a competition this year with one lucky member who joins between 18th February and 31st March getting their CFSAC membership fees (60) refunded. The draw for this will be held on Thursday 31st March.\r\n\r\nBSAC are also offering a 15 discount on their fees for anyone who joins at the Big Scuba Show.\r\n\r\nFor more information on the Big Scuba Show or to book a ticket, visit: <a href=\"http://www.thebigscubashow.com/\" target=\"_blank\">http://www.thebigscubashow.com/</a>','The Big Scuba Show - February 19/20th 2011','','publish','closed','closed','','the-big-scuba-show-february-1920th','','','2012-01-07 10:07:20','2012-01-07 10:07:20','',0,'http://cfsac.byethost3.com/?p=96',0,'post','',0),(97,1,'2011-02-18 19:17:34','2011-02-18 19:17:34','','dive-illustration-earls-court','','inherit','closed','closed','','dive-illustration-earls-court','','','2011-02-18 19:17:34','2011-02-18 19:17:34','',96,'http://cfsac.byethost3.com/wp-content/uploads/2011/02/dive-illustration-earls-court.gif',0,'attachment','image/gif',0),(124,1,'2012-01-06 18:01:08','2012-01-06 18:01:08','Date: 22nd or 29th April\r\n\r\nA great way to start the season.  One entry fee will be paid for by the club so its Free.  Come along to give yourself and your kit a shake down after the winter, practice some skills, try new kit that Santa delivered or request some training from an instructor.  The club will be offering two dates so all members can make use of this opportunity. Please indicate the day and date of your preferred weekend.','April - 2012 - Stoney Cove','','publish','closed','closed','','april-2012-stoney-cove','','','2012-12-15 18:02:43','2012-12-15 18:02:43','',0,'http://www.cfsac.co.uk/?p=124',0,'post','',0),(125,1,'2012-01-06 17:58:42','2012-01-06 17:58:42','','Stoney Cove','','inherit','closed','closed','','stoney-cove','','','2012-01-06 17:58:42','2012-01-06 17:58:42','',124,'http://www.cfsac.co.uk/wp-content/uploads/2012/01/Stoney-Cove.jpg',0,'attachment','image/jpeg',0),(144,1,'2012-01-06 18:09:07','2012-01-06 18:09:07','Date: 5th and 6th May\r\n\r\nA new boat to the club  Rocket a 40 foot fast cat - with its skipper Trevor Small  a recommendation by Andy who used to run Beowulf out of Poole before he retired.  Diving from Poole harbour it is an easily accessible trip from London. From Poole you can head west towards Swanage & Weymouth or east towards Southampton and the Isle of Wight.  Easy boat loading, cheap parking on Saturday and free on Sunday.  The boat cost is 47 per day (includes lunch). Accommodation tbc. Not a great weekend tide-wise  some pretty high springs! \r\n\r\n','May - 2012 - Poole','','publish','closed','closed','','may-2012-poole','','','2012-12-15 18:02:53','2012-12-15 18:02:53','',0,'http://www.cfsac.co.uk/?p=144',0,'post','',0),(148,1,'2012-01-06 18:13:20','2012-01-06 18:13:20','Date: 2nd to 5th June\r\n\r\nSkipper Len Bateman who runs Predator which can hold up to 12 divers. New lift fitted. Dive sites are planned on the way out. Nitrox fills available Boat costs are 45 per day. Accommodation tbc but will probably include a camping option as well as B&B.','June - 2012 - Pembroke','','publish','closed','closed','','june-2012-pembroke','','','2012-12-15 18:03:02','2012-12-15 18:03:02','',0,'http://www.cfsac.co.uk/?p=148',0,'post','',0),(149,1,'2012-01-06 18:12:48','2012-01-06 18:12:48','','smallsrocksweb','','inherit','closed','closed','','smallsrocksweb','','','2012-01-06 18:12:48','2012-01-06 18:12:48','',148,'http://www.cfsac.co.uk/wp-content/uploads/2012/01/smallsrocksweb.jpg',0,'attachment','image/jpeg',0),(153,1,'2012-01-06 18:16:22','2012-01-06 18:16:22','Date: 23rd and 24th June\r\n\r\nDive Time is booked again  its the big yellow boat with the chilled out skipper, Paul Pike.  Aiming to do some quality wrecks and pretty drifts with a high chance of a haul of scallops.  Kit can be left onboard overnight.  Accommodation has been booked for Friday/Saturday at the Bunker.  Boat is 49 per day inc. fabulous homemade soup lunch.  B&B is expected to be 23 per night or you can bring your own sleeping bag/pillow and self cater for 13.50.  Dinner is 12 on the Saturday night. Meet on Friday night at the Cove pub on Chesil beach just across the road.','June - 2012 - Weymouth','','publish','closed','closed','','june-2012-weymouth','','','2012-12-15 17:07:53','2012-12-15 17:07:53','',0,'http://www.cfsac.co.uk/?p=153',0,'post','',0),(155,1,'2012-01-06 18:17:41','2012-01-06 18:17:41','Date: 14th and 15th July\r\n\r\nIts the Swanage Jazz Festival this weekend but dont let that deter you. We have the charter boat booked however Martin and Bryan are building a new Venom 38 to replace Sidewinder  faster and with a hydraulic rear platform lift. Kit can be left on between dives but the boat does come back to the pier. Also there will be a new 11m pontoon to make loading easier. Boat is around 45 per day. The diving will be at the deeper end of the scale hence why we have put this trip later in the season as with last year to ensure everyone has had a couple of sea dives beforehand. Accommodation has been booked at the Tower Lodge as in previous years for Friday and Saturday night and will be around 32 per night. Best neap weekend of the year!','July - 2012 - Swanage','','publish','closed','closed','','july-2012-swanage','','','2012-12-15 17:08:09','2012-12-15 17:08:09','',0,'http://www.cfsac.co.uk/?p=155',0,'post','',0),(157,1,'2012-01-06 18:20:48','2012-01-06 18:20:48','Date: 19th to 24th August\r\n\r\nShore based 6 days trip travelling down on Saturday diving Sunday through Friday on board an offshore 105 with Skipper Dave McBride. Staying in one of 2 B&Bs which are close by (one of which is run by Dave and his wife) or there is camping. Accommodation  options are 30 bed only, 35 breakfast diy style, 40 cooked breakfast provided. Travel is either by plane - 4 flights on saturdays (one way fares from Southampton 135, Exeter 100, Bristol 115, Newquay 75 or Lands End 60) or passenger ferry (one way from Penzance 42.50). Share of container will be approx 13 each two way. Passenger Ferry sailings on Saturdays at 10:30am from Penzance (see www.ios-travel.co.uk for detailed costs). Boat fees 23 per day.  Please let Ruth know your preferred travel option and whether you are happy to offer a lift if driving to Penzance.','August - 2012 - Scillies','','publish','closed','closed','','august-2012-scillies','','','2012-12-15 18:03:39','2012-12-15 18:03:39','',0,'http://www.cfsac.co.uk/?p=157',0,'post','',0),(158,1,'2012-01-06 18:20:18','2012-01-06 18:20:18','','scillies','','inherit','closed','closed','','scillies','','','2012-01-06 18:20:18','2012-01-06 18:20:18','',157,'http://www.cfsac.co.uk/wp-content/uploads/2012/01/scillies.jpg',0,'attachment','image/jpeg',0),(161,1,'2012-01-06 18:27:06','2012-01-06 18:27:06','Date: 23rd September\r\n\r\nEasy to get to  1 hr 15min from Roehampton so I am reliably told. The boat, Wight Diver, is equipped with a lift, dry area for kit/changing, tea & coffee, stove/oven and a toilet.  Runs from the Eastney side of Langstone Harbour where there is plenty of free parking available. Air fills can be organized at the Dive Centre. Diving in the area ranges from Landing Craft in around 8m, Fossil Bed drifts, Camswan in 18m which has an intact stern and is a great dive, the Prince Leopold, Camberwell, Highland Brigade etc all around 30-35m.  A number of great sites between 30 and 40m. Boat fees are 48. Decent neap tides.','September - 2012 - Portsmouth','','publish','closed','closed','','september-2012-portsmouth','','','2012-12-15 18:03:47','2012-12-15 18:03:47','',0,'http://www.cfsac.co.uk/?p=161',0,'post','',0),(162,1,'2012-01-06 18:24:57','2012-01-06 18:24:57','','portsmouth','','inherit','closed','closed','','portsmouth','','','2012-01-06 18:24:57','2012-01-06 18:24:57','',161,'http://www.cfsac.co.uk/wp-content/uploads/2012/01/portsmouth.jpg',0,'attachment','image/jpeg',0),(164,1,'2012-01-06 18:28:58','2012-01-06 18:28:58','Date: 13th and 14th October\r\n\r\nBecoming a club favourite for late season diving, we have booked Loyal Watcher again to go diving in Plymouth.  The diving is well worth the trip down the M5.  Dont be put off by it being late in the year, the seas are probably at their warmest, the vis can be excellent and the Loyal Watcher is a very stable boat that can get out in weathers that others refuse (and its stable when it is out !).  The package is all inclusive of boat, accommodation, brekkies, lunch, dinner (both Saturday and Sunday), air & parking  only the beer is extra.  All at 92 per day and only ONE cylinder is required.','October - 2012 - Plymouth','','publish','closed','closed','','october-2012-plymouth','','','2012-12-15 18:04:55','2012-12-15 18:04:55','',0,'http://www.cfsac.co.uk/?p=164',0,'post','',0),(170,1,'2013-01-18 17:30:42','2013-01-18 17:30:42','On Saturday 2nd February 2013 the Club held their AGM at The Stonemasons Arms in Hammersmith.\r\n\r\nA pleasant evening was held with some business and much food and drink.\r\n\r\nThe 2013 Committee were elected as follows:\r\n<ul>\r\n	<li>Chairman &amp; Welfare Officer - Talwyn W.</li>\r\n	<li>Diving Officer - Frank B.</li>\r\n	<li>Treasurer - Ali W.</li>\r\n	<li>Membership Secretary - Becky S.</li>\r\n	<li>Expeditions Officer - Ruth B.</li>\r\n	<li>Equipment Officer - Tony M.</li>\r\n	<li>Social Secretary - Iain K.</li>\r\n	<li>Training Officer - Dave B.</li>\r\n</ul>\r\n&nbsp;','February - 2013 - Club AGM','','publish','closed','closed','','february-2012-club-agm','','','2015-03-23 21:59:44','2015-03-23 21:59:44','',0,'http://www.cfsac.co.uk/?p=170',0,'post','',0),(171,1,'2012-01-06 18:39:27','2012-01-06 18:39:27','','idlehour','','inherit','closed','closed','','idlehour','','','2012-01-06 18:39:27','2012-01-06 18:39:27','',170,'http://www.cfsac.co.uk/wp-content/uploads/2012/01/idlehour.jpg',0,'attachment','image/jpeg',0),(203,2,'2012-12-08 20:55:53','2012-12-08 20:55:53','[caption id=\"attachment_204\" align=\"alignleft\" width=\"300\" caption=\"Chelsea &amp; Fulham SAC Christmas Meal is being held on Thursday 20th December 2012. Contact Becky for details.\"]<a href=\"http://www.cfsac.co.uk/wp-content/uploads/2012/12/Christmas-Snowman-theme.png\"><img class=\"size-medium wp-image-204\" title=\"Christmas Snowman theme\" src=\"http://www.cfsac.co.uk/wp-content/uploads/2012/12/Christmas-Snowman-theme-300x164.png\" alt=\"\" width=\"300\" height=\"164\" /></a>[/caption]','December 2012 - Christmas Meal','','publish','closed','closed','','december-2012-christmas-meal','','','2013-01-18 17:36:06','2013-01-18 17:36:06','',0,'http://www.cfsac.co.uk/?p=203',0,'post','',0),(204,2,'2012-12-08 20:50:55','2012-12-08 20:50:55','','Christmas Snowman theme','Chelsea & Fulham SAC Christmas Meal is being held on Thursday 20th December 2012. Contact Becky for details.','inherit','closed','closed','','christmas-snowman-theme','','','2012-12-08 20:50:55','2012-12-08 20:50:55','',203,'http://www.cfsac.co.uk/wp-content/uploads/2012/12/Christmas-Snowman-theme.png',0,'attachment','image/png',0),(218,2,'2012-12-15 16:43:05','2012-12-15 16:43:05','<strong>Sat. 20<sup>th</sup> April, Sat 27<sup>th</sup> April or 4<sup>th</sup> May- Training/Warm Up Dive  Stoney Cove</strong>\r\n\r\nA great way to start the season. One entry fee will be paid for by the club so its <strong>Free</strong>. Come along to give yourself and your kit a shake down after the winter, practice some skills, try new kit that Santa delivered or request some training from an instructor. The club will be offering two dates so all members can make use of this opportunity. We will run 2 days out of the 3 options\r\n\r\n&nbsp;','April - 2013 - Stoney Cove','','publish','closed','closed','','april-2013-stoney-cove','','','2015-03-22 20:02:46','2015-03-22 20:02:46','',0,'http://www.cfsac.co.uk/?p=218',0,'post','',0),(222,2,'2012-12-15 16:45:50','2012-12-15 16:45:50','<strong>11<sup>th</sup> and 12<sup>th</sup> May (2 day)  Poole</strong>\r\n\r\nA relatively new boat to the club used for the first time this year  Rocket a 40 foot fast cat - with its skipper Trevor Small Diving from Poole harbour it is an easily accessible trip from London. Easy boat loading, cheap parking on Saturday and free parking on Sunday. The boat cost is 47 per day (includes lunch usually an excellent barbecue). I have booked some B&amp;B accommodation by recommendation at the Quayside B&amp;B (not the same as last year!). B&amp;B costs around 27-30 per night.\r\n\r\n&nbsp;','May - 2013 - Poole','','publish','closed','closed','','may-2013-poole','','','2015-03-22 20:02:42','2015-03-22 20:02:42','',0,'http://www.cfsac.co.uk/?p=222',0,'post','',0),(225,2,'2012-12-15 16:48:52','2012-12-15 16:48:52','<strong>25<sup>th</sup> &amp; 26<sup>th</sup> May (1 or 2 days)  Portsmouth. <em> </em></strong>\r\n\r\nThe emphasis will be towards newer divers wanting to get some more sea experience on Day 1. Day 2 will be for more experienced divers however this will depend on level of interest. Easy to get to  1 hr 15min from Roehampton so I am reliably told. The boat, Wight Diver, is equipped with a lift, dry area for kit/changing, tea &amp; coffee, stove/oven and a toilet. Runs from the Eastney side of Langstone Harbour where there is plenty of free parking available. Air fills can be organized at the Dive Centre. Diving in the area ranges from Landing Craft in around 8m, Fossil Bed drifts, Camswan in 18m which has an intact stern and is a great dive, the Prince Leopold, Camberwell, Highland Brigade etc all around 30-35m. Boat fees are 54. Sign up for 1 or 2 days\r\n\r\n&nbsp;','May - 2013 - Portsmouth','','publish','closed','closed','','may-2013-portsmouth','','','2015-03-22 20:02:39','2015-03-22 20:02:39','',0,'http://www.cfsac.co.uk/?p=225',0,'post','',0),(227,2,'2012-12-15 16:49:59','2012-12-15 16:49:59','<strong>15<sup>th</sup> &amp; 16<sup>th</sup> June (2 day)  Swanage</strong>\r\n\r\nWe have the charter boat booked Vyper, new as of 2012, with a hydraulic rear platform lift. Kit can be left on between dives but the boat does come back to the pier. Also there will be a new 11m pontoon to make loading easier. Boat is 45 per day. Some accommodation will be booked at the Tower Lodge as in previous years for Friday and Saturday night (32-40 per night).\r\n\r\n&nbsp;','June - 2013 - Swanage','','publish','closed','closed','','june-2013-swanage','','','2015-03-22 20:02:35','2015-03-22 20:02:35','',0,'http://www.cfsac.co.uk/?p=227',0,'post','',0),(229,2,'2012-12-15 16:52:09','2012-12-15 16:52:09','<strong>13th &amp;14<sup>th</sup> July (2 day)  Lyme Regis</strong>\r\n\r\nWe miss the great diving and icecream at Lyme so we have decided to go back after a couple of years break. Same boat but a new skipper. Maximum number of divers on this trip is 10. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). However a new skipper may have some new sites! Im looking into booking a new B&amp;B as our regular place has stopped.\r\n\r\n&nbsp;','July - 2013 - Lyme Regis','','publish','closed','closed','','july-2013-lyme-regis','','','2017-12-04 16:31:05','2017-12-04 16:31:05','',0,'http://www.cfsac.co.uk/?p=229',0,'post','',0),(231,2,'2012-12-15 16:54:05','2012-12-15 16:54:05','<strong>28<sup>th</sup> July  2<sup>nd</sup> August (6 day)  Scillies</strong>\r\n\r\nSo good were the reports from this years trip we have decided to run another trip. Shore based 6 days trip travelling down on Saturday. Diving Sunday through Friday on board an offshore 105 with Skipper Dave McBride. Accommodation available in an excellent B&amp;B which is close by (run by Dave and his wife). There are camping or self catering options.\r\n\r\nPassenger Ferry sailings are on Saturdays at 10:30am from Penzance (see <a href=\"http://www.ios-travel.co.uk/\">www.ios-travel.co.uk</a> for detailed costs). Total cost likely to be around 700-850 depending on your accommodation option (estimate includes ferry cost and evening meals). For more info email Ruth. Boat details to be found at <a href=\"http://www.divescilly.com/\">http://www.divescilly.com/</a>\r\n\r\n&nbsp;','July - 2013 - Scillies','','publish','closed','closed','','july-2013-scillies','','','2015-03-22 20:02:28','2015-03-22 20:02:28','',0,'http://www.cfsac.co.uk/?p=231',0,'post','',0),(233,2,'2012-12-15 16:54:41','2012-12-15 16:54:41','<strong>17<sup>th</sup> &amp; 18<sup>th</sup> August (2 day)  Weymouth </strong>\r\n\r\nMissed out this year due to the Olympics. Boat is Dive Time. Skipper Paul Pike  a dependable skipper who always delivers. Boat costs 50 per day. We will try to do the wrecks that we dont often get to do so get in your requests early! Maximum of 10 divers (boat restriction brought in this year due to growing numbers of twinset divers bringing the kitchen sink with them).\r\n\r\n&nbsp;','August - 2013 - Weymouth','','publish','closed','closed','','august-2013-weymouth','','','2015-03-22 20:02:23','2015-03-22 20:02:23','',0,'http://www.cfsac.co.uk/?p=233',0,'post','',0),(235,2,'2012-12-15 16:55:52','2012-12-15 16:55:52','<strong>6<sup>th</sup>, 7<sup>th</sup> &amp; 8<sup>th</sup> September (3 days)  Farnes</strong>\r\n\r\nA favourite of the club and plenty of opportunity to see seals. We will be diving from the boat Glad tidings which we used in 2011.Diving costs 40 per day. I have booked some B&amp;B accommodation in Seahouses at Horncliffe Guesthouse (30 pppn).\r\n\r\n&nbsp;','September - 2013 - Farnes','','publish','closed','closed','','september-2013-farnes','','','2015-03-22 20:01:57','2015-03-22 20:01:57','',0,'http://www.cfsac.co.uk/?p=235',0,'post','',0),(237,2,'2012-12-15 16:56:59','2012-12-15 16:56:59','<strong>12<sup>th </sup>&amp; 13<sup>th</sup> October (2 day)  Plymouth</strong>\r\n\r\nBecoming a club favourite for late season diving, we have booked Loyal Watcher for the 4<sup>th</sup> year running to go diving in Plymouth. The diving is well worth the trip down the M5. Dont be put off by it being late in the year, the seas are probably at their warmest, the vis can be excellent and the Loyal Watcher is a very stable boat that can get out in weathers that others refuse (and its stable when it is out !). The package is all inclusive of boat, accommodation, breakfasts, lunch, dinner (both Saturday and Sunday), air &amp; parking  only the beer is extra. 100 per day all in. Only ONE cylinder is required.\r\n\r\n&nbsp;','October - 2013 - Plymouth','','publish','closed','closed','','october-2013-plymouth','','','2015-03-22 20:01:53','2015-03-22 20:01:53','',0,'http://www.cfsac.co.uk/?p=237',0,'post','',0),(239,2,'2012-12-15 16:57:56','2012-12-15 16:57:56','<strong>26<sup>th</sup> &amp; 27<sup>th</sup> October (2 day)  Weymouth (SKINDEEPER)</strong>\r\n\r\nWho is up for a late season dive? The boat is the fast catamaran Skindeeper owned and skippered by Ian Taylor. Boat fees 54 per day. Accommodation at the Bunker (23 per night and supper on Saturday 13 per night).<strong><em> </em></strong>\r\n\r\n&nbsp;','October - 2013 - Weymouth','','publish','closed','closed','','october-2013-weymouth','','','2015-03-22 20:01:49','2015-03-22 20:01:49','',0,'http://www.cfsac.co.uk/?p=239',0,'post','',0),(293,2,'2012-12-15 18:31:15','2012-12-15 18:31:15','','Farnes','','inherit','closed','closed','','farnes','','','2012-12-15 18:31:15','2012-12-15 18:31:15','',0,'http://www.cfsac.co.uk/wp-content/uploads/2012/12/Farnes.jpg',0,'attachment','image/jpeg',0),(294,2,'2012-12-15 18:31:37','2012-12-15 18:31:37','','lyme-regis','','inherit','closed','closed','','lyme-regis','','','2012-12-15 18:31:37','2012-12-15 18:31:37','',0,'http://www.cfsac.co.uk/wp-content/uploads/2012/12/lyme-regis.jpg',0,'attachment','image/jpeg',0),(295,2,'2012-12-15 18:31:57','2012-12-15 18:31:57','','skindeeper_side','','inherit','closed','closed','','skindeeper_side','','','2012-12-15 18:31:57','2012-12-15 18:31:57','',0,'http://www.cfsac.co.uk/wp-content/uploads/2012/12/skindeeper_side.jpg',0,'attachment','image/jpeg',0),(300,2,'2013-01-18 17:30:03','2013-01-18 17:30:03','','Stonemasons__041_4818','','inherit','closed','closed','','stonemasons__041_4818','','','2013-01-18 17:30:03','2013-01-18 17:30:03','',0,'http://www.cfsac.co.uk/wp-content/uploads/2013/01/Stonemasons__041_4818.jpg',0,'attachment','image/jpeg',0),(313,2,'2014-01-05 17:03:27','2014-01-05 17:03:27','<strong>Sat. 19<sup>th</sup> April, Sat 26<sup>th</sup> April or<strong>3<sup>rd</sup></strong> May- Training/Warm Up Dive  Stoney Cove</strong>\r\n\r\nA great way to start the season. One entry fee will be paid for by the club so its<strong>Free</strong>. Come along to give yourself and your kit a shake down after the winter, practice some skills, try new kit that Santa delivered or request some training from an instructor. The club will be offering two dates so all members can make use of this opportunity. We will run 2 days out of the 3 options\r\n\r\n&nbsp;','April - 2014 - Stoney Cove','','publish','closed','closed','','april-2014-stoney-cove','','','2015-03-22 20:01:37','2015-03-22 20:01:37','',0,'http://www.cfsac.co.uk/?p=313',0,'post','',0),(319,2,'2014-01-05 17:17:16','2014-01-05 17:17:16','<strong>10<sup>th</sup></strong><strong> </strong><strong>and 11<sup>th</sup></strong><strong> </strong><strong>May (2 day)  Poole/Swanage</strong>\r\n\r\nA comfortable boat Rocket a 40 foot fast cat - with a lovely friendly skipper, Trevor Small. Diving usually from Poole harbour but he will pick up and drop off from Swanage harbour. It is an easily accessible trip from London. Boat cost includes lunch (usually an excellent barbecue). B&amp;B for whole group available atTower Lodge.<strong> </strong>\r\n\r\n&nbsp;','May - 2014 - Swanage','','publish','closed','closed','','may-2014-swanage','','','2015-03-22 20:00:44','2015-03-22 20:00:44','',0,'http://www.cfsac.co.uk/?p=319',0,'post','',0),(325,2,'2014-01-05 17:27:10','2014-01-05 17:27:10','Aimed at the less experienced divers and an opportunity for training.\n\n&nbsp;','May - 2014 - Shore Diving','','draft','closed','closed','','','','','2015-05-26 08:17:31','2015-05-26 08:17:31','',0,'http://www.cfsac.co.uk/?p=325',0,'post','',0),(327,2,'2014-01-05 17:51:06','2014-01-05 17:51:06','<strong>7<sup>th</sup> and 8<sup>th</sup> June (2 day)  Weymouth</strong>\r\n\r\n<strong> </strong>\r\n\r\nBoat is Dive Time  very roomy and comfortable and stable with plenty of shelter in case of bad weather. Skipper Paul Pike  a dependable skipper who always delivers. The bunker is already booked so I am booking the Beach House which is next to The Cove pub. Early season dive so nothing too ambitious. A good for new divers\r\n\r\n&nbsp;','June - 2014 - Weymouth','','publish','closed','closed','','june-2014-weymouth','','','2015-03-22 19:58:24','2015-03-22 19:58:24','',0,'http://www.cfsac.co.uk/?p=327',0,'post','',0),(329,2,'2014-01-05 17:55:37','2014-01-05 17:55:37','<strong>24th - 26th (3 day)  Plymouth</strong>\r\n\r\n<strong> </strong>\r\n\r\nNorthstar - a new boat this year for Gary Kelham of SouthWestDiving. Boat cost includes lunch. A trial for the club as we have not used this skipper or his operation before. This is sold as an individuals trip with 12 spacesof which we have 8 spaces. Dives planned are Day 1: Scylla &amp; Poulmic, Day 2: Hand Deeps &amp; Eddystone Lighthouse, Day 3 James Eagan Layne &amp; Coronation. <span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>. Max Depth 30m.<strong> </strong>\r\n\r\n&nbsp;','May - 2014 - Plymouth','','publish','closed','closed','','may-2014-plymouth','','','2015-03-22 19:57:56','2015-03-22 19:57:56','',0,'http://www.cfsac.co.uk/?p=329',0,'post','',0),(332,2,'2014-01-05 17:37:21','2014-01-05 17:37:21','<strong>5<sup>th</sup> &amp; 6<sup>th</sup></strong><strong> </strong><strong>July (2 day)  Lyme Regis</strong>\r\n\r\nHoping for the same fantastic weather we had last year. Lovely easy going skipper on board the Blue Turtle. Maximum number of divers on this trip is 10. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation at Devonia and possibly Charnwood as last year (or camping option).\r\n\r\n&nbsp;','July - 2014 - Lyme Regis','','publish','closed','closed','','july-2014-lyme-regis','','','2017-12-04 16:31:19','2017-12-04 16:31:19','',0,'http://www.cfsac.co.uk/?p=332',0,'post','',0),(337,2,'2014-01-05 17:44:23','2014-01-05 17:44:23','<strong>19<sup>th</sup></strong><strong> </strong><strong>&amp; 20<sup>th</sup></strong><strong> </strong><strong>July (2 day)  Swanage</strong>\r\n\r\nWe have the charter boat booked Vyper, new as of 2012, with a hydraulic rear platform lift. Kit can be left on between dives but the boat does come back to the pier. Very easy loading. Accommodation will be available at the Tower Lodge as in previous years for Friday and Saturday night for the whole group (or camping options).\r\n\r\n&nbsp;','July - 2014 - Swanage','','publish','closed','closed','','july-2014-swanage','','','2015-03-22 19:59:01','2015-03-22 19:59:01','',0,'http://www.cfsac.co.uk/?p=337',0,'post','',0),(340,2,'2014-01-05 17:45:40','2014-01-05 17:45:40','<strong>2<sup>nd</sup> and 3<sup>rd</sup> August (2 day)  Lyme Regis</strong>\r\n\r\nSame trip details as above trip. Dive Boat is Blue Turtle. Lovely easy going skipper. Maximum number of divers is 10. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation tbc  may be self catering (or camping option).\r\n\r\n&nbsp;','August - 2014 - Lyme Regis','','publish','closed','closed','','august-2014-lyme-regis','','','2017-12-04 16:31:38','2017-12-04 16:31:38','',0,'http://www.cfsac.co.uk/?p=340',0,'post','',0),(342,2,'2014-01-05 17:49:05','2014-01-05 17:49:05','<strong>23<sup>rd</sup> to 26<sup>th</sup> August (4 day) - Porthkerris</strong>\r\n\r\nA favourite of the club. We will be diving from the Kitten. Accommodation either at Parc an Grouse in St Keverne or another B&amp;B in St Keverne (or camping options).\r\n\r\n&nbsp;','August - 2014 - Porthkerris','','publish','closed','closed','','august-2014-porthkerris','','','2015-03-22 19:58:30','2015-03-22 19:58:30','',0,'http://www.cfsac.co.uk/?p=342',0,'post','',0),(344,2,'2014-01-05 17:52:53','2014-01-05 17:52:53','<strong>20<sup>th</sup> and 21<sup>st</sup> September (2 day)  Weymouth</strong>\r\n\r\nBoat is Dive Time. Skipper Paul Pike  a dependable skipper who always delivers. We will try to do the slightly deeper wrecks that we dont often get to do so get in your wreck requests early! Accommodation at the Bunker.\r\n\r\n&nbsp;','September - 2014 - Weymouth','','publish','closed','closed','','september-2014-weymouth','','','2015-03-22 19:58:16','2015-03-22 19:58:16','',0,'http://www.cfsac.co.uk/?p=344',0,'post','',0),(346,2,'2014-01-05 17:54:07','2014-01-05 17:54:07','<strong>4<sup>th</sup> and 5<sup>th</sup> October (2 day)  Poole</strong>\r\n\r\nA comfortable boat Rocket a 40 foot fast cat - with a lovely friendly skipper, Trevor Small. Boat cost includes lunch (usually an excellent barbecue).<strong> </strong>\r\n\r\n&nbsp;','October - 2014 - Poole','','publish','closed','closed','','october-2014-poole','','','2015-03-22 19:58:07','2015-03-22 19:58:07','',0,'http://www.cfsac.co.uk/?p=346',0,'post','',0),(348,2,'2014-01-11 12:58:20','2014-01-11 12:58:20','<strong>18<sup>th</sup> and 19<sup>th</sup> October (2 day)  Plymouth</strong>\r\n\r\n<strong> </strong>\r\n\r\nLoyal Watcher is no longer available as a dive charter so I have chartered TopGun out of Mount Batten Marina in Plymouth. Boat costs include lunch &amp; tea/coffee. The diving is usually well worth the trip down the M5. Dont be put off by it being late in the year, the seas are probably at their warmest and the vis can be excellent. Accommodation will be B&amp;B for Friday and Saturday night.\r\n\r\n&nbsp;','October - 2014 - Plymouth','','publish','closed','closed','','october-2014-plymouth','','','2015-03-22 19:57:30','2015-03-22 19:57:30','',0,'http://www.cfsac.co.uk/?p=348',0,'post','',0),(370,2,'2014-01-05 18:42:22','2014-01-05 18:42:22','','Plymouth-Hoe','','inherit','closed','closed','','plymouth-hoe','','','2014-01-05 18:42:22','2014-01-05 18:42:22','',0,'http://www.cfsac.co.uk/wp-content/uploads/2014/01/Plymouth-Hoe.jpg',0,'attachment','image/jpeg',0),(371,2,'2014-01-05 18:42:33','2014-01-05 18:42:33','','Wembury-Bay-Plymouth-UK-007','','inherit','closed','closed','','wembury-bay-plymouth-uk-007','','','2014-01-05 18:42:33','2014-01-05 18:42:33','',0,'http://www.cfsac.co.uk/wp-content/uploads/2014/01/Wembury-Bay-Plymouth-UK-007.jpg',0,'attachment','image/jpeg',0),(412,2,'2014-01-11 14:35:38','2014-01-11 14:35:38','','Try Dive','','inherit','closed','closed','','img_3149','','','2014-01-11 14:35:38','2014-01-11 14:35:38','',0,'http://www.cfsac.co.uk/wp-content/uploads/2014/01/IMG_3149.jpg',0,'attachment','image/jpeg',0),(413,2,'2014-01-11 14:45:11','2014-01-11 14:45:11','Thinking about learning to dive but not certain if its for you?\r\n\r\nCome along for a Try Dive. These can be arranged for most Thursday evenings.\r\n\r\nContact Dave on 07905916821 or email contactcfsac@gmail.com\r\n\r\n&nbsp;','Try Dives','','publish','closed','closed','','try-dives','','','2014-01-11 14:45:42','2014-01-11 14:45:42','',0,'http://www.cfsac.co.uk/?p=413',0,'post','',0),(423,4,'2015-03-22 19:56:12','2015-03-22 19:56:12','<strong>16<sup>th</sup> - 17<sup>th</sup> (2 day)  Poole</strong>\r\n\r\nA comfortable boat Rocket a 40 foot fast cat - with a lovely friendly skipper, Trevor Small. Diving usually from Poole harbour but he will pick up and drop off from Swanage harbour. It is an easily accessible trip from London. Boat cost is 48 per day (includes lunch usually an excellent barbecue).','May - 2015 - Poole','','publish','closed','closed','','may-2015-poole','','','2015-05-26 08:18:31','2015-05-26 08:18:31','',0,'http://www.cfsac.co.uk/?p=423',0,'post','',0),(427,4,'2015-03-22 20:06:36','2015-03-22 20:06:36','<strong>30<sup>th</sup> and 31<sup>st</sup> (2 day)  Swanage</strong>\r\n\r\nCharter boat Viper. Can take 12 divers. Boat comes back to the pier between dives but you can leave kit on between dives. Very easy loading. Boat is approx. 48 per day. I will book B&amp;B or bunkhouse accommodation unless anyone wishes to camp. Very reasonable start times for the Kyarra and Carantan.\r\n\r\nDetails of campsites available\r\nToms Field http://www.tomsfieldcamping.co.uk/index.html BH19 3HN\r\nBurnbake campsite www.burnbake.com BH20 5JH','May - 2015 - Swanage','','publish','closed','closed','','may-2015-swanage','','','2015-06-04 17:11:29','2015-06-04 17:11:29','',0,'http://www.cfsac.co.uk/?p=427',0,'post','',0),(431,4,'2015-03-22 20:09:41','2015-03-22 20:09:41','<strong>Sat 18<sup>th</sup> April, Sat 25<sup>th</sup> April orSat 9<sup>th</sup> May- Training/Warm Up Dive  Stoney Cove</strong>\r\n\r\nA great way to start the season. One entry fee will be paid for by the club so its<strong>Free</strong>. Come along to give yourself and your kit a shake down after the winter, practice some skills, try new kit that Santa delivered or request some training from an instructor. The club will be offering two dates so all members can make use of this opportunity.','April/May - 2015 - Stoney Cove','','publish','closed','closed','','aprilmay-2015-stoney-cove','','','2015-06-19 17:23:41','2015-06-19 17:23:41','',0,'http://www.cfsac.co.uk/?p=431',0,'post','',0),(435,4,'2015-03-22 20:12:56','2015-03-22 20:12:56','<strong>13<sup>th</sup> - 14<sup>th</sup> (2 day)  Poole</strong>\r\n\r\nBoat is Dive Time  very roomy and comfortable and stable with plenty of shelter in case of bad weather. Skipper Paul Pike  a dependable skipper who always delivers. Boat costs 54 per day. B&amp;B accommodation at the Beach House which is next to The Cove pub or I may book a couple of static caravans at the caravan park depending on interest. A good work up trip for divers intending to come on the Scapa Flow trip, we intend to do some of the deeper wrecks.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','June - 2015 - Portland','','publish','closed','closed','','june-2015-portland','','','2015-06-19 17:23:47','2015-06-19 17:23:47','',0,'http://www.cfsac.co.uk/?p=435',0,'post','',0),(437,4,'2015-03-22 20:16:22','2015-03-22 20:16:22','<strong>18<sup>th</sup> - 19<sup>th</sup> (2 day)  Lyme Regis</strong>\r\n\r\nDive Boat is Blue Turtle. Lovely easy going skipper. Maximum number of divers is 10. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation tbc but plenty of variety  B&amp;B, bunkhouse or camping.','July - 2015 - Lyme Regis','','publish','closed','closed','','july-2015-lyme-regis','','','2017-12-04 16:31:46','2017-12-04 16:31:46','',0,'http://www.cfsac.co.uk/?p=437',0,'post','',0),(439,4,'2015-03-22 20:18:01','2015-03-22 20:18:01','<strong>25<sup>th</sup> - 26<sup>th</sup> (2 day)  Swanage</strong>\r\n\r\nShuttle boat Mary Jo. 6 spaces booked. Can be increased if there is more interest. Boat comes back to the pier between dives. Boat is approx. 45 per day. Plenty of B&B or bunkhouse accommodation.','July - 2015 - Swanage','','publish','closed','closed','','july-2015-swanage','','','2015-08-02 11:35:25','2015-08-02 11:35:25','',0,'http://www.cfsac.co.uk/?p=439',0,'post','',0),(441,4,'2015-03-22 20:19:11','2015-03-22 20:19:11','This has now been changed to a one day trip to Vobster Quay on Saturday 8<sup>th</sup> August in lieu of the Portland trip due to the boat being unavailable.\r\n\r\n<del datetime=\"2015-08-02T11:37:26+00:00\"><strong>8<sup>th</sup> - 9<sup>th</sup> (2 day)  Portland</strong></del>\r\n\r\n<del datetime=\"2015-08-02T11:37:26+00:00\">Boat is Dive Time  very roomy and comfortable and stable with plenty of shelter in case of bad weather. Skipper Paul Pike  a dependable skipper who always delivers. Boat costs 54 per day. B&B accommodation at the Beach House which is next to The Cove pub or camping. We may not be able to book the caravans for a weekend in peak season. Open to all qualified divers. Plenty of accessible wrecks and drifts at and below 20m for the Ocean diver.</del>','August - 2015 - Vobster Quay','','publish','closed','closed','','august-2015-vobster','','','2015-08-19 17:06:49','2015-08-19 17:06:49','',0,'http://www.cfsac.co.uk/?p=441',0,'post','',0),(443,4,'2015-03-22 20:20:42','2015-03-22 20:20:42','<strong>5<sup>th</sup> - 6<sup>th</sup> (2 day)  Plymouth</strong>\r\n\r\nTop Gun out of Mount Batten Marina in Plymouth.  Boat costs are 48 per day including lunch & tea/coffee. The diving is usually well worth the trip down the M5.  Dont be put off by it being late in the year, the seas are probably at their warmest, the vis can be excellent. Accommodation will be B&B for Friday and Saturday night in the region of 35-40 pn.','September - 2015 - Plymouth','','publish','closed','closed','','september-2015-plymouth','','','2015-09-08 15:41:18','2015-09-08 15:41:18','',0,'http://www.cfsac.co.uk/?p=443',0,'post','',0),(445,4,'2015-03-22 20:22:04','2015-03-22 20:22:04','<strong>19<sup>th</sup> - 21<sup>st</sup> (3 day)  Pembroke</strong>\r\n\r\nCharter Boat Wandrin Star diving out of Fishguard in Pembrokeshire. Package include accommodation. Boat and accommodation is 165 all in for the 3 days (not including food and air).','September - 2015 - Pembroke','','publish','closed','closed','','september-2015-pembroke','','','2015-09-22 16:35:52','2015-09-22 16:35:52','',0,'http://www.cfsac.co.uk/?p=445',0,'post','',0),(447,4,'2015-03-22 20:25:01','2015-03-22 20:25:01','<strong>17<sup>th</sup> onwards (3-5 days)  Gulf of Naples </strong>\r\n\r\nI would like to book a short trip in the Med to get some warm water diving before the winter. A group organised by Tony went to Baia in Naples last October where they dived on the fascinating underwater Roman settlement. Some of the sites are shallow enough to snorkel. Plenty of shallow diving (sub 12m) and some deeper sites.\r\nSee examples <a href=\"http://www.parcoarcheologicosommersodibaia.it/parco.php?id_lingua=en\">here</a> and <a href=\"http://centrosubcampiflegrei.it/\">here</a>, Tony stayed at <a href=\"http://www.latripergola.it/lang/it/home.php\">here</a>. Anyone interested let me know and I will find out more details and costs.','October - 2015 - Baia','','publish','closed','closed','','october-2015-baia','','','2015-11-05 16:13:06','2015-11-05 16:13:06','',0,'http://www.cfsac.co.uk/?p=447',0,'post','',0),(456,4,'2015-03-22 20:38:27','2015-03-22 20:38:27','<strong>5<sup>th</sup> - 10<sup>st</sup> - Scapa Flow</strong>\r\n\r\nWe will be diving with Radiant Queen Charters on board the new MV Huskyan and exploring the awe inspiring wrecks of the WW1 German High Seas Fleet beneath Scapa Flow. You will also get the opportunity to immerse yourself in the fascinating history and beautiful wild landscape of the Orkneys above water too. <a href=\"http://www.radiantqueen.co.uk/\">Here is more information</a> about the Dive Operation.\r\n\r\nGiven the type of diving, divers will need to be Dive Leaders or committed to reaching Dive Leader level by next July.','July - 2015 - Scapa Flow','','publish','closed','closed','','july-2015-scapa-flow','','','2015-07-15 14:06:16','2015-07-15 14:06:16','',0,'http://www.cfsac.co.uk/?p=456',0,'post','',0),(464,4,'2015-03-22 20:57:09','2015-03-22 20:57:09','On Saturday 7th February 2015 the Club held their AGM at The Raven in Stamford Brook.\r\n\r\nA pleasant evening was held with some business and much food and drink.\r\n\r\nThe 2015 Committee were elected as follows:\r\n<ul>\r\n 	<li>Chairman - David Saunders</li>\r\n 	<li>Diving Officer - Frank Betts</li>\r\n 	<li>Treasurer - Ali Worsley</li>\r\n 	<li>Membership Secretary - Sarah Chapman</li>\r\n 	<li>Expeditions Officer - Ruth Beaver</li>\r\n 	<li>Equipment Officer - Tony Moore</li>\r\n 	<li>Asst. Equipment Officer - Alistair Cott</li>\r\n 	<li>Social Secretary - Kate Medhurst</li>\r\n 	<li>Training Officer - Dave Bennett</li>\r\n 	<li>Welfare Officer &amp; Asst. Equipment Officer - Kathryn Sizer</li>\r\n</ul>','February - 2015 - Club AGM','','publish','closed','closed','','february-2015-club-agm','','','2016-11-19 13:45:22','2016-11-19 13:45:22','',0,'http://www.cfsac.co.uk/?p=464',0,'post','',0),(470,4,'2015-04-01 18:25:26','2015-04-01 18:25:26','','Cruisers at Scapa','','inherit','closed','closed','','cruisers-at-scapa','','','2015-04-01 18:25:26','2015-04-01 18:25:26','',0,'http://www.cfsac.co.uk/wp-content/uploads/2015/04/Cruisers-at-Scapa.jpg',0,'attachment','image/jpeg',0),(471,4,'2015-04-01 18:28:33','2015-04-01 18:28:33','','baiae','','inherit','closed','closed','','baiae','','','2015-04-01 18:28:33','2015-04-01 18:28:33','',447,'http://www.cfsac.co.uk/wp-content/uploads/2015/03/baiae.jpg',0,'attachment','image/jpeg',0),(478,4,'2015-08-02 11:43:06','2015-08-02 11:43:06','','vobster','','inherit','closed','closed','','vobster','','','2015-08-02 11:43:06','2015-08-02 11:43:06','',0,'http://www.cfsac.co.uk/wp-content/uploads/2015/08/vobster.png',0,'attachment','image/png',0),(483,4,'2015-11-05 16:14:32','2015-11-05 16:14:32','[et_pb_section admin_label=\"section\"][et_pb_row admin_label=\"row\"][et_pb_column type=\"4_4\"][et_pb_blog admin_label=\"Blog\" fullwidth=\"off\" include_categories=\"6\" show_thumbnail=\"on\" show_content=\"off\" show_more=\"on\" show_author=\"on\" show_date=\"on\" show_categories=\"on\" show_comments=\"on\" show_pagination=\"on\" offset_number=\"0\" use_overlay=\"off\" background_layout=\"light\" use_dropshadow=\"off\" use_border_color=\"off\" border_color=\"#ffffff\" border_style=\"solid\" posts_number=\"15\"]\r\n\r\n\r\n\r\n[/et_pb_blog][/et_pb_column][/et_pb_row][/et_pb_section]','Upcoming Dives','','publish','closed','closed','','dive-calendar-2018','','','2017-12-03 19:09:53','2017-12-03 19:09:53','',0,'http://www.cfsac.co.uk/?page_id=483',0,'page','',0),(485,4,'2015-11-05 16:15:16','2015-11-05 16:15:16',' ','','','publish','closed','closed','','485','','','2016-07-13 10:24:52','2016-07-13 10:24:52','',0,'http://www.cfsac.co.uk/?p=485',2,'nav_menu_item','',0),(487,4,'2016-01-18 17:56:41','2016-01-18 17:56:41','<strong>Sat 9<sup>th</sup> April or Sat 7<sup>th</sup> May- Training/Warm Up Dive  Stoney Cove</strong>\r\n\r\nA great way to start the season. One entry fee will be paid for by the club so its <strong>Free</strong>. Come along to give yourself and your kit a shake down after the winter, practice some skills, try new kit that Santa delivered or request some training from an instructor. The club will be offering two dates so all members can make use of this opportunity.','April/May - 2016 - Stoney Cove','','publish','closed','closed','','aprilmay-2016-stoney-cove','','','2016-11-19 12:54:17','2016-11-19 12:54:17','',0,'http://www.cfsac.co.uk/?p=487',0,'post','',0),(489,4,'2016-01-18 17:58:53','2016-01-18 17:58:53','<strong>23<sup>rd</sup> - 24<sup>th</sup> (2 day)  Portland</strong>\r\n\r\nBoat is Skindeep (this is a shuttle service) very roomy and comfortable and stable with plenty of shelter in case of bad weather. Dives are Cragside, Lulworth Banks, Countess of Erne and James Fennel. 6 diver with possibility of increasing booking size.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Ocean Divers &amp; above</span>.','April - 2016 - Portland','','publish','closed','closed','','april-2016-portland','','','2016-11-19 12:54:11','2016-11-19 12:54:11','',0,'http://www.cfsac.co.uk/?p=489',0,'post','',0),(491,4,'2016-01-18 18:02:48','2016-01-18 18:02:48','<strong>14<sup>th</sup> - 15<sup>th</sup> (2 day)  Swanage</strong>\r\n\r\nCharter boat Viper. Can take 12 divers. Boat comes back to the pier between dives but you can leave kit on between dives. Very easy loading. Boat is approx. 500 per day. I will book B&amp;B or bunkhouse accommodation unless anyone wishes to camp.\r\n\r\nDetails of campsites available:\r\nTom\'s Field <a title=\"Tom\'s Field\" href=\"www.tomsfieldcamping.co.uk/index.html\" target=\"_blank\">www.tomsfieldcamping.co.uk/index.html</a> BH19 3HN\r\nBurnbake campsite <a title=\"Burnbake campsite\" href=\"www.burnbake.com\" target=\"_blank\">www.burnbake.com</a> BH20 5JH\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Ocean Divers &amp; above</span>.','May - 2016 - Swanage','','publish','closed','closed','','may-2016-swanage','','','2016-11-19 12:54:07','2016-11-19 12:54:07','',0,'http://www.cfsac.co.uk/?p=491',0,'post','',0),(494,4,'2016-01-18 18:04:51','2016-01-18 18:04:51','<strong>25<sup>th</sup> - 26<sup>th</sup> (2 day)  Poole</strong>\r\n\r\nA comfortable boat Rocket a 40 foot fast cat - with a lovely friendly skipper, Trevor Small. Diving usually from Poole harbour but he will pick up and drop off from Swanage harbour. It is an easily accessible trip from London. Boat cost is 52 per day (includes lunch usually an excellent barbecue).\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Ocean Divers &amp; above</span>.','June - 2016 - Poole','','publish','closed','closed','','june-2016-poole','','','2016-11-19 12:53:56','2016-11-19 12:53:56','',0,'http://www.cfsac.co.uk/?p=494',0,'post','',0),(496,4,'2016-01-18 18:06:35','2016-01-18 18:06:35','<strong>16<sup>th</sup> - 17<sup>th</sup> (2 day)  Lyme Regis</strong>\r\n\r\nDive Boat is Blue Turtle. Lovely easy going skipper. Maximum number of divers is 10. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation tbc but plenty of variety  B&B, bunkhouse or camping.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','July - 2016 - Lyme Regis','','publish','closed','closed','','july-2016-lyme-regis','','','2017-12-04 16:32:06','2017-12-04 16:32:06','',0,'http://www.cfsac.co.uk/?p=496',0,'post','',0),(498,4,'2016-01-18 18:08:09','2016-01-18 18:08:09','<strong>6<sup>rd</sup> - 7<sup>th</sup> (2 day)  Portland</strong>\r\n\r\nBoat is Tango  very roomy and comfortable and stable with plenty of shelter in case of bad weather. A new boat and skipper for the club. Boat costs 54 per day. B&B accommodation at the Beach House which is next to The Cove pub or camping. \r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Ocean Divers &amp; above</span>.','August - 2016 - Portland','','publish','closed','closed','','august-2016-portland','','','2016-11-19 12:53:44','2016-11-19 12:53:44','',0,'http://www.cfsac.co.uk/?p=498',0,'post','',0),(500,4,'2016-01-18 18:12:47','2016-01-18 18:12:47','<strong>27<sup>th</sup> August - 3<sup>rd</sup> September (6 day)  Scillies</strong>\r\n\r\nCharter Boat Tiburon. Skipper Dave McBride. Based on St Marys Diving 28th August  2nd September.\r\n\r\nApprox cost of diving and accommodation is 450. Ferry, air and food extra. Ferry across on Saturday morning 10:30 am from Penzance. Deposit of 150 required to secure a place.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','August - 2016 - Scillies','','publish','closed','closed','','august-2016-scillies','','','2016-11-19 12:53:39','2016-11-19 12:53:39','',0,'http://www.cfsac.co.uk/?p=500',0,'post','',0),(502,4,'2016-01-18 18:14:39','2016-01-18 18:14:39','<strong>24<sup>th</sup> - 26<sup>th</sup> (3 day)  Farnes</strong>\r\n\r\nSovereign Diver hardboat out of Seahouses. You cant beat the Farnes for encounters with seals (well apart from the Scillies). September  October is the best time to dive with seals which is the focus of the trip. There are wrecks and scenic dives as well. Accommodation in Seahouses.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','September - 2016 - Farnes','','publish','closed','closed','','september-2016-farnes','','','2016-11-19 12:53:33','2016-11-19 12:53:33','',0,'http://www.cfsac.co.uk/?p=502',0,'post','',0),(514,4,'2016-01-18 18:03:18','2016-01-18 18:03:18','<strong>11<sup>th</sup> - 12<sup>th</sup> (2 day)  Plymouth</strong>\r\n\r\nHard boat Explorer out of Mount Batten Marina in Plymouth. Boat costs are 48 per day including lunch &amp; tea/coffee. The diving is usually well worth the trip down the M5. Accommodation will be B&amp;B for Friday and Saturday night in the region of 35-40.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','June - 2016 - Plymouth','','publish','closed','closed','','514','','','2016-11-19 12:54:02','2016-11-19 12:54:02','',0,'http://www.cfsac.co.uk/?p=514',0,'post','',0),(558,1,'2016-07-13 09:27:41','2016-07-13 09:27:41','[et_pb_section admin_label=\"section\" fullwidth=\"on\" specialty=\"off\" inner_shadow=\"off\" parallax=\"off\" background_color=\"#2ea3f2\"][et_pb_fullwidth_post_slider admin_label=\"Fullwidth Post Slider\" include_categories=\"6\" orderby=\"rand\" show_arrows=\"on\" show_pagination=\"on\" show_more_button=\"on\" content_source=\"off\" use_manual_excerpt=\"on\" show_meta=\"on\" background_layout=\"dark\" show_image=\"on\" image_placement=\"background\" parallax=\"off\" parallax_method=\"off\" use_bg_overlay=\"on\" use_text_overlay=\"off\" remove_inner_shadow=\"off\" background_position=\"default\" background_size=\"default\" auto=\"off\" auto_ignore_hover=\"off\" hide_content_on_mobile=\"off\" hide_cta_on_mobile=\"off\" show_image_video_mobile=\"off\" meta_letter_spacing=\"0\" custom_button=\"off\" button_letter_spacing=\"0\" button_use_icon=\"default\" button_icon_placement=\"right\" button_on_hover=\"on\" button_letter_spacing_hover=\"0\"]\r\n\r\n\r\n\r\n[/et_pb_fullwidth_post_slider][/et_pb_section][et_pb_section admin_label=\"section\"][et_pb_row admin_label=\"row\"][et_pb_column type=\"4_4\"][et_pb_text admin_label=\"Text\" background_layout=\"light\" text_orientation=\"left\" use_border_color=\"off\" border_color=\"#ffffff\" border_style=\"solid\"]\r\n\r\n<h2>Welcome to the Chelsea and Fulham Sub-Aqua Club.</h2>\r\nWe are a small, friendly club with about 45 members. We were founded back in the 1950s and are branch No. 45 of the British Sub-Aqua Club (BSAC). Our members cover a wide range of ages but are predominantly in their 30s and 40s and we probably have one of the highest percentages of female divers in the area.\r\n\r\nWithin the club there is a wealth of diving experience, ranging from qualified instructors, advanced divers and dive leaders, to those who are just beginning.\r\n\r\nDuring the summer months, we enjoy regular weekend trips to the coast, descending to 30 metres and having a mooch around the wrecks and checking out the marine life.\r\n\r\nThe club has excellent relationships with some of the best dive charters on the south coast and we hire hard boats for the weekend diving activities throughout the summer.\r\n\r\n<a href=\"http://www.cfsac.co.uk/about/\">Read more...</a>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label=\"row\"][et_pb_column type=\"1_2\"][et_pb_blog admin_label=\"Blog\" fullwidth=\"on\" posts_number=\"3\" include_categories=\"4\" show_thumbnail=\"on\" show_content=\"off\" show_more=\"off\" show_author=\"on\" show_date=\"on\" show_categories=\"on\" show_comments=\"on\" show_pagination=\"on\" offset_number=\"0\" use_overlay=\"off\" background_layout=\"light\" use_dropshadow=\"off\" use_border_color=\"off\" border_color=\"#ffffff\" border_style=\"solid\"]\r\n\r\n\r\n\r\n[/et_pb_blog][/et_pb_column][et_pb_column type=\"1_2\"][et_pb_blog admin_label=\"Blog\" fullwidth=\"on\" posts_number=\"3\" include_categories=\"7\" show_thumbnail=\"on\" show_content=\"off\" show_more=\"off\" show_author=\"on\" show_date=\"on\" show_categories=\"on\" show_comments=\"on\" show_pagination=\"on\" offset_number=\"0\" use_overlay=\"off\" backgr