 10:04:14','2016-07-13 10:04:14','',574,'http://www.cfsac.co.uk/574-revision-v1/',0,'revision','',0),(576,1,'2016-07-13 10:04:42','2016-07-13 10:04:42','[et_pb_section admin_label=\"section\"][et_pb_row admin_label=\"row\"][et_pb_column type=\"4_4\"][et_pb_blog admin_label=\"Blog\" fullwidth=\"off\" include_categories=\"9\" show_thumbnail=\"on\" show_content=\"off\" show_more=\"off\" show_author=\"on\" show_date=\"on\" show_categories=\"on\" show_comments=\"on\" show_pagination=\"on\" offset_number=\"0\" use_overlay=\"off\" background_layout=\"light\" use_dropshadow=\"off\" use_border_color=\"off\" border_color=\"#ffffff\" border_style=\"solid\" posts_number=\"9\"] [/et_pb_blog][/et_pb_column][/et_pb_row][/et_pb_section]','Archive','','inherit','closed','closed','','574-revision-v1','','','2016-07-13 10:04:42','2016-07-13 10:04:42','',574,'http://www.cfsac.co.uk/574-revision-v1/',0,'revision','',0),(577,1,'2016-07-13 10:15:14','2016-07-13 10:15:14','<h3>Welcome to the Chelsea and Fulham Sub-Aqua Club.</h3>\r\nWe are a small, friendly club with about 45 members. We were founded back in the 1950\'s and are branch No. 45 of the British Sub-Aqua Club (BSAC). Our members cover a wide range of ages but are predominantly in their 30\'s and 40\'s and we probably have one of the highest percentages of female divers in the area.\r\n\r\nWithin the club there is a wealth of diving experience, ranging from qualified instructors, advanced divers and dive leaders, to those who are just beginning.\r\n\r\nDuring the summer months, we enjoy regular weekend trips to the coast, descending to 30 metres and having a mooch around the wrecks and checking out the marine life.\r\n\r\nThe club has excellent relationships with some of the best dive charters on the south coast and we hire hard boats for the weekend diving activities throughout the summer.\r\n<h3>Location</h3>\r\nCharing Cross Hospital Social Club, Aspenlea Road, W6 8LH\r\n\r\nWe meet every Thursday night at the Charing Cross Hospital Social Club, on Aspenlea Road, also accessible from Fulham Palace Road, near Hammersmith, London.\r\n\r\nWe have the use of the four metre deep pool from 8:30 p.m on Thursday.\r\n\r\nAfter pool sessions we can usually be found at The Pear Tree: 14 Margravine Road, London W6 8HJ.\r\n<h3>Nearest Underground Stations</h3>\r\nBarons Court\r\n\r\nHammersmith\r\n<h3>Parking</h3>\r\nVehicles can be parked inside the Charing Cross hospital grounds @ about 2.00 per hour. (free after 9pm)\r\n\r\nThere is free street parking in Aspenlea Road after 5.30 p.m.','About','','inherit','closed','closed','','2-revision-v1','','','2016-07-13 10:15:14','2016-07-13 10:15:14','',2,'http://www.cfsac.co.uk/2-revision-v1/',0,'revision','',0),(578,1,'2016-07-13 10:15:55','2016-07-13 10:15:55','<h3>Joining</h3>\r\nJoining the Chelsea and Fulham Sub-Aqua Club is easy, whether you are new to the sport, want to continue your training, or are already qualified and want to go diving with a club.\r\n\r\nContact us, details below, and they will arrange for you to come to a pool session on a club night. We\'ll take you for a swim or a \'try dive\', introduce you to some of the members and finish off with a pint in the bar. If you would like to join us, then its as simple as completing some paperwork and parting with a cheque.\r\n<h3>Qualified Member</h3>\r\nThe fee is 115.50. This includes 60 per year membership to CFSAC (Chelsea and Fulham Sub-Aqua Club) and 55.50 for annual BSAC (British Sub Aqua Club) membership.\r\n<h3>Trainee</h3>\r\nThe fee is 202.50. This is the total for a new diver and includes: 100 for the first year of membership to CFSAC (Chelsea and Fulham Sub-Aqua Club), 55.50 for annual BSAC (British Sub Aqua Club) membership and 47 for books, log book etc.\r\n<h3>Additional Information</h3>\r\nFor a diver continuing membership for a second year, the club fees are reduced to 50 per year. The reason the first year is more expensive is to cover the cost of equipment hire maintenance and servicing, air fills and training. It is assumed that by the second year you will have bought at least some of your own equipment and so the club fees are reduced to take this into account.\r\n\r\nStudent members and instructors may be eligible for a discount on their BSAC membership fees. Student fees are currently 28 per year and instructor fees are 50.50 per year.\r\n<h3>Contact Us</h3>\r\nDave Bennett (Training Officer)\r\n\r\n07905916821\r\n<a href=\"mailto:contactcfsac@gmail.com\">contactcfsac@gmail.com</a>','Join CFSAC','','inherit','closed','closed','','75-revision-v1','','','2016-07-13 10:15:55','2016-07-13 10:15:55','',75,'http://www.cfsac.co.uk/75-revision-v1/',0,'revision','',0),(585,1,'2016-07-13 10:19:21','2016-07-13 10:19:21','<h2><strong>Learning to dive with Chelsea and Fulham Sub Aqua Club:</strong></h2>\r\n<h3>Ocean Diver</h3>\r\nOcean Diver is the BSAC beginners course for learning to dive. The course provides you with the essential knowledge and skills needed to prepare for open water diving. Learning to dive is all about learning to use your equipment properly and safely, learning safety skills, signals to communicate with your buddy etc. The Ocean Diver training course concentrates on preparing you for open water in the safety of a swimming pool or sheltered water and then introducing you to open water in a controlled and safe manner. Training is always done in the company of a qualified instructor or experienced diver.\r\n\r\nThe BSAC Ocean Diver Course includes a basic swimming assessment, seven theory lessons, approximately ten practical lessons and practice sessions in a swimming pool, five open water dives and a theory assessment.\r\n\r\nAfter successful completion of the Ocean Diver qualification, you will be qualified to dive to a maximum depth of 20m.\r\n\r\nPool training starts at 8:30 pm on Thursday evening. We are very flexible in our training and can start courses whenever necessary.\r\n<h3>Sports Diver</h3>\r\nThis course is designed to develop divers beyond the basics learned during the Ocean Diver course. The emphasis is on building a solid foundation of open water diving skills and experience through a series of structured practical lessons under the guidance of a qualified instructor.\r\n\r\nOnce this qualification has been obtained divers can follow a progressive build up to a depth of 35m.\r\n<h3>Dive Leader</h3>\r\nFollowing successful completion of the Sports Diver qualification, divers can begin training for the Dive Leader qualification. This looks at the responsibilities and safety aspects of leading other divers on open water dives. During the practical lessons, you will learn rescue management techniques and rescue skills that will give you the confidence and ability to deal with unforeseen emergencies.\r\n\r\nOnce this qualification has been obtained divers can follow a progressive build up to a depth of 50m.\r\n<h3>Become an Instructor</h3>\r\nSeveral of our divers have continued their training and become instructors or assistant instructors. If you are an experienced diver and would like to develop teaching skills we will be happy to help you achieve your instructor qualifications.','Learn to Dive','','inherit','closed','closed','','71-revision-v1','','','2016-07-13 10:19:21','2016-07-13 10:19:21','',71,'http://www.cfsac.co.uk/71-revision-v1/',0,'revision','',0),(588,1,'2016-07-13 10:24:52','2016-07-13 10:24:52',' ','','','publish','closed','closed','','588','','','2016-07-13 10:24:52','2016-07-13 10:24:52','',0,'http://www.cfsac.co.uk/?p=588',3,'nav_menu_item','',0),(589,1,'2016-07-13 10:31:10','2016-07-13 10:31:10','<strong>11<sup>th</sup> - 12<sup>th</sup> (2 day)  Plymouth</strong>\r\n\r\nHard boat Explorer out of Mount Batten Marina in Plymouth. Boat costs are 48 per day including lunch &amp; tea/coffee. The diving is usually well worth the trip down the M5. Accommodation will be B&amp;B for Friday and Saturday night in the region of 35-40.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','June - 2016 - Plymouth','','inherit','closed','closed','','514-revision-v1','','','2016-07-13 10:31:10','2016-07-13 10:31:10','',514,'http://www.cfsac.co.uk/514-revision-v1/',0,'revision','',0),(590,1,'2016-07-13 10:31:53','2016-07-13 10:31:53','<strong>Sat 9<sup>th</sup> April or Sat 7<sup>th</sup> May- Training/Warm Up Dive  Stoney Cove</strong>\r\n\r\nA great way to start the season. One entry fee will be paid for by the club so its <strong>Free</strong>. Come along to give yourself and your kit a shake down after the winter, practice some skills, try new kit that Santa delivered or request some training from an instructor. The club will be offering two dates so all members can make use of this opportunity.','April/May - 2016 - Stoney Cove','','inherit','closed','closed','','487-revision-v1','','','2016-07-13 10:31:53','2016-07-13 10:31:53','',487,'http://www.cfsac.co.uk/487-revision-v1/',0,'revision','',0),(591,1,'2016-07-13 16:42:03','2016-07-13 16:42:03','','logo','','inherit','closed','closed','','logo','','','2016-07-13 16:42:03','2016-07-13 16:42:03','',0,'http://www.cfsac.co.uk/wp-content/uploads/2016/07/logo.png',0,'attachment','image/png',0),(594,4,'2016-11-19 12:53:33','2016-11-19 12:53:33','<strong>24<sup>th</sup> - 26<sup>th</sup> (3 day)  Farnes</strong>\r\n\r\nSovereign Diver hardboat out of Seahouses. You cant beat the Farnes for encounters with seals (well apart from the Scillies). September  October is the best time to dive with seals which is the focus of the trip. There are wrecks and scenic dives as well. Accommodation in Seahouses.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','September - 2016 - Farnes','','inherit','closed','closed','','502-revision-v1','','','2016-11-19 12:53:33','2016-11-19 12:53:33','',502,'http://www.cfsac.co.uk/502-revision-v1/',0,'revision','',0),(595,4,'2016-11-19 12:53:39','2016-11-19 12:53:39','<strong>27<sup>th</sup> August - 3<sup>rd</sup> September (6 day)  Scillies</strong>\r\n\r\nCharter Boat Tiburon. Skipper Dave McBride. Based on St Marys Diving 28th August  2nd September.\r\n\r\nApprox cost of diving and accommodation is 450. Ferry, air and food extra. Ferry across on Saturday morning 10:30 am from Penzance. Deposit of 150 required to secure a place.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','August - 2016 - Scillies','','inherit','closed','closed','','500-revision-v1','','','2016-11-19 12:53:39','2016-11-19 12:53:39','',500,'http://www.cfsac.co.uk/500-revision-v1/',0,'revision','',0),(596,4,'2016-11-19 12:53:44','2016-11-19 12:53:44','<strong>6<sup>rd</sup> - 7<sup>th</sup> (2 day)  Portland</strong>\r\n\r\nBoat is Tango  very roomy and comfortable and stable with plenty of shelter in case of bad weather. A new boat and skipper for the club. Boat costs 54 per day. B&B accommodation at the Beach House which is next to The Cove pub or camping. \r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Ocean Divers &amp; above</span>.','August - 2016 - Portland','','inherit','closed','closed','','498-revision-v1','','','2016-11-19 12:53:44','2016-11-19 12:53:44','',498,'http://www.cfsac.co.uk/498-revision-v1/',0,'revision','',0),(597,4,'2016-11-19 12:53:49','2016-11-19 12:53:49','<strong>16<sup>th</sup> - 17<sup>th</sup> (2 day)  Lyme Regis</strong>\r\n\r\nDive Boat is Blue Turtle. Lovely easy going skipper. Maximum number of divers is 10. A variety of diving  some great shallow wrecks like the Baygettano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation tbc but plenty of variety  B&B, bunkhouse or camping.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','July - 2016 - Lyme Regis','','inherit','closed','closed','','496-revision-v1','','','2016-11-19 12:53:49','2016-11-19 12:53:49','',496,'http://www.cfsac.co.uk/496-revision-v1/',0,'revision','',0),(598,4,'2016-11-19 12:53:56','2016-11-19 12:53:56','<strong>25<sup>th</sup> - 26<sup>th</sup> (2 day)  Poole</strong>\r\n\r\nA comfortable boat Rocket a 40 foot fast cat - with a lovely friendly skipper, Trevor Small. Diving usually from Poole harbour but he will pick up and drop off from Swanage harbour. It is an easily accessible trip from London. Boat cost is 52 per day (includes lunch usually an excellent barbecue).\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Ocean Divers &amp; above</span>.','June - 2016 - Poole','','inherit','closed','closed','','494-revision-v1','','','2016-11-19 12:53:56','2016-11-19 12:53:56','',494,'http://www.cfsac.co.uk/494-revision-v1/',0,'revision','',0),(599,4,'2016-11-19 12:54:07','2016-11-19 12:54:07','<strong>14<sup>th</sup> - 15<sup>th</sup> (2 day)  Swanage</strong>\r\n\r\nCharter boat Viper. Can take 12 divers. Boat comes back to the pier between dives but you can leave kit on between dives. Very easy loading. Boat is approx. 500 per day. I will book B&amp;B or bunkhouse accommodation unless anyone wishes to camp.\r\n\r\nDetails of campsites available:\r\nTom\'s Field <a title=\"Tom\'s Field\" href=\"www.tomsfieldcamping.co.uk/index.html\" target=\"_blank\">www.tomsfieldcamping.co.uk/index.html</a> BH19 3HN\r\nBurnbake campsite <a title=\"Burnbake campsite\" href=\"www.burnbake.com\" target=\"_blank\">www.burnbake.com</a> BH20 5JH\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Ocean Divers &amp; above</span>.','May - 2016 - Swanage','','inherit','closed','closed','','491-revision-v1','','','2016-11-19 12:54:07','2016-11-19 12:54:07','',491,'http://www.cfsac.co.uk/491-revision-v1/',0,'revision','',0),(600,4,'2016-11-19 12:54:11','2016-11-19 12:54:11','<strong>23<sup>rd</sup> - 24<sup>th</sup> (2 day)  Portland</strong>\r\n\r\nBoat is Skindeep (this is a shuttle service) very roomy and comfortable and stable with plenty of shelter in case of bad weather. Dives are Cragside, Lulworth Banks, Countess of Erne and James Fennel. 6 diver with possibility of increasing booking size.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Ocean Divers &amp; above</span>.','April - 2016 - Portland','','inherit','closed','closed','','489-revision-v1','','','2016-11-19 12:54:11','2016-11-19 12:54:11','',489,'http://www.cfsac.co.uk/489-revision-v1/',0,'revision','',0),(601,4,'2016-11-19 12:56:38','2016-11-19 12:56:38','<strong>Sat 15<sup>th</sup> or Sat 29<sup>th</sup> April- Training/Warm Up Dive  Stoney Cove</strong>\r\n\r\nA great way to start the season. One entry fee will be paid for by the club so its <strong>Free</strong>. Come along to give yourself and your kit a shake down after the winter, practice some skills, try new kit that Santa delivered or request some training from an instructor. The club will be offering two dates so all members can make use of this opportunity.','April - 2017 - Stoney Cove','','publish','closed','closed','','april-2017-stoney-cove','','','2017-05-02 08:48:17','2017-05-02 08:48:17','',0,'http://www.cfsac.co.uk/?p=601',0,'post','',0),(602,4,'2016-11-19 12:56:38','2016-11-19 12:56:38','<strong>Sat 15<sup>th</sup> or Sat 29<sup>th</sup> April- Training/Warm Up Dive  Stoney Cove</strong>\r\n\r\nA great way to start the season. One entry fee will be paid for by the club so its <strong>Free</strong>. Come along to give yourself and your kit a shake down after the winter, practice some skills, try new kit that Santa delivered or request some training from an instructor. The club will be offering two dates so all members can make use of this opportunity.','April - 2017 - Stoney Cove','','inherit','closed','closed','','601-revision-v1','','','2016-11-19 12:56:38','2016-11-19 12:56:38','',601,'http://www.cfsac.co.uk/601-revision-v1/',0,'revision','',0),(603,4,'