_meta=\"on\" background_layout=\"dark\" show_image=\"on\" image_placement=\"background\" parallax=\"off\" parallax_method=\"off\" use_bg_overlay=\"on\" use_text_overlay=\"off\" remove_inner_shadow=\"off\" background_position=\"default\" background_size=\"default\" auto=\"off\" auto_ignore_hover=\"off\" hide_content_on_mobile=\"off\" hide_cta_on_mobile=\"off\" show_image_video_mobile=\"off\" meta_letter_spacing=\"0\" custom_button=\"off\" button_letter_spacing=\"0\" button_use_icon=\"default\" button_icon_placement=\"right\" button_on_hover=\"on\" button_letter_spacing_hover=\"0\"]\r\n\r\n\r\n\r\n[/et_pb_fullwidth_post_slider][/et_pb_section][et_pb_section admin_label=\"section\"][et_pb_row admin_label=\"row\"][et_pb_column type=\"4_4\"][et_pb_text admin_label=\"Text\" background_layout=\"light\" text_orientation=\"left\" use_border_color=\"off\" border_color=\"#ffffff\" border_style=\"solid\"]\r\n\r\n<h2>Welcome to the Chelsea and Fulham Sub-Aqua Club.</h2>\r\nWe are a small, friendly club with about 45 members. We were founded back in the 1950s and are branch No. 45 of the British Sub-Aqua Club (BSAC). Our members cover a wide range of ages but are predominantly in their 30s and 40s and we probably have one of the highest percentages of female divers in the area.\r\n\r\nWithin the club there is a wealth of diving experience, ranging from qualified instructors, advanced divers and dive leaders, to those who are just beginning.\r\n\r\nDuring the summer months, we enjoy regular weekend trips to the coast, descending to 30 metres and having a mooch around the wrecks and checking out the marine life.\r\n\r\nThe club has excellent relationships with some of the best dive charters on the south coast and we hire hard boats for the weekend diving activities throughout the summer.\r\n\r\n<a href=\"http://www.cfsac.co.uk/about/\">Read more...</a>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label=\"row\"][et_pb_column type=\"1_2\"][et_pb_blog admin_label=\"