 business and much food and drink.\r\n\r\nThe 2017 Committee were elected as follows:\r\n<ul>\r\n        <li>Chairman - David Saunders</li>\r\n        <li>Treasurer - Ali Worsley</li>\r\n 	<li>Diving Officer - Frank Betts</li>\r\n        <li>Expeditions Officer - Ruth Beaver</li>\r\n        <li>Social Secretary - Kate Medhurst</li>\r\n 	<li>Membership Secretary - Tony Moore</li>\r\n        <li>Training Officer - Dave Bennett</li>\r\n 	<li>Equipment Officer - Tony Moore (Assistant  Ally Cott)</li>\r\n 	<li>Welfare Officer - Kat Sizer</li>\r\n        <li>IT and Website Officer - Ally Cott</li>\r\n</ul>','February - 2017 - Club AGM','','inherit','closed','closed','','649-revision-v1','','','2017-02-08 06:26:28','2017-02-08 06:26:28','',649,'http://www.cfsac.co.uk/649-revision-v1/',0,'revision','',0),(658,4,'2017-05-29 15:30:17','2017-05-29 15:30:17','<strong>21<sup>st</sup> - 28<sup>th</sup> July (7 day)  Isle of Man</strong>\r\n\r\nA longer trip to the Isle of Man with diving with seals (possible Basking Sharks) and wrecks.\r\n\r\nA weekly package with seven nights 4 star accommodation with breakfast is supplied. This package includes twelve boat dives including your air and full use of the dive centre facilities.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','July - 2017 - Isle of Man','','inherit','closed','closed','','620-revision-v1','','','2017-05-29 15:30:17','2017-05-29 15:30:17','',620,'http://www.cfsac.co.uk/620-revision-v1/',0,'revision','',0),(661,4,'2017-06-23 09:08:55','2017-06-23 09:08:55','<strong>5<sup>th</sup> - 6<sup>th</sup> August (2 day)  Weymouth</strong>\r\n\r\nBoat is Tango  very roomy and comfortable and stable with plenty of shelter in case of bad weather. A new boat and skipper for the club. Boat costs 54 per day. B&B accommodation at the Beach House on Portland which is next to The Cove pub or camping. B&B costs 33-40 per night for a shared room. There is the option to stay on the boat for 10 per night  one roomy cabin with electricity sleeps 6 -bring towels and sleeping bags. ','August  2017  Weymouth','','inherit','closed','closed','','612-revision-v1','','','2017-06-23 09:08:55','2017-06-23 09:08:55','',612,'http://www.cfsac.co.uk/612-revision-v1/',0,'revision','',0),(667,4,'2017-12-03 18:39:27','2017-12-03 18:39:27','<h3>Joining</h3>\nJoining the Chelsea and Fulham Sub-Aqua Club is easy, whether you are new to the sport, want to continue your training, or are already qualified and want to go diving with a club.\n\nContact us, details below, and they will arrange for you to come to a pool session on a club night. We\'ll take you for a swim or a \'try dive\', introduce you to some of the members and finish off with a pint in the bar. If you would like to join us, then its as simple as completing some paperwork and parting with a cheque.\n<h3>Qualified Member</h3>\nThe fee is 107.50. This includes 50 per year membership to CFSAC (Chelsea and Fulham Sub-Aqua Club) and 57.50 for annual BSAC (British Sub Aqua Club) membership.\n<h3>Trainee</h3>\nThe fee is 202.50. This is the total for a new diver and includes: 100 for the first year of membership to CFSAC (Chelsea and Fulham Sub-Aqua Club), 57.50 for annual BSAC (British Sub Aqua Club) membership and 45 for books, log book etc.\n<h3>Additional Information</h3>\nFor a diver continuing membership for a second year, the club fees are reduced to 50 per year. The reason the first year is more expensive is to cover the cost of equipment hire maintenance and servicing, air fills and training. It is assumed that by the second year you will have bought at least some of your own equipment and so the club fees are reduced to take this into account.\n\nStudent members and instructors may be eligible for a discount on their BSAC membership fees. Student fees are currently 28 per year and instructor fees are 50.50 per year.\n<h3>Contact Us</h3>\nDave Bennett (Training Officer)\n\n07905916821\n<a href=\"mailto:contactcfsac@gmail.com\">contactcfsac@gmail.com</a>','Join CFSAC','','inherit','closed','closed','','75-autosave-v1','','','2017-12-03 18:39:27','2017-12-03 18:39:27','',75,'http://www.cfsac.co.uk/75-autosave-v1/',0,'revision','',0),(668,4,'2017-12-03 18:43:30','2017-12-03 18:43:30','<h3>Joining</h3>\r\nJoining the Chelsea and Fulham Sub-Aqua Club is easy, whether you are new to the sport, want to continue your training, or are already qualified and want to go diving with a club.\r\n\r\nContact us, details below, and they will arrange for you to come to a pool session on a club night. We\'ll take you for a swim or a \'try dive\', introduce you to some of the members and finish off with a pint in the bar. If you would like to join us, then its as simple as completing some paperwork.\r\n<h3>Qualified Member</h3>\r\nThe fee is 107.50. This includes 50 per year membership to CFSAC (Chelsea and Fulham Sub-Aqua Club) and 57.50 for annual BSAC (British Sub Aqua Club) membership.\r\n<h3>Trainee</h3>\r\nThe fee is 202.50. This is the total for a new diver and includes: 100 for the first year of membership to CFSAC (Chelsea and Fulham Sub-Aqua Club), 57.50 for annual BSAC (British Sub Aqua Club) membership and 45 for books, log book etc.\r\n<h3>Additional Information</h3>\r\nFor a diver continuing membership for a second year, the club fees are reduced to 50 per year. The reason the first year is more expensive is to cover the cost of equipment hire maintenance and servicing, air fills and training. It is assumed that by the second year you will have bought at least some of your own equipment and so the club fees are reduced to take this into account.\r\n\r\nStudent members and instructors may be eligible for a discount on their BSAC membership fees. Student fees are currently 29.50 per year and instructor fees are 52.50 per year.\r\n<h3>Contact Us</h3>\r\nDave Bennett (Training Officer)\r\n\r\n07905916821\r\n<a href=\"mailto:contactcfsac@gmail.com\">contactcfsac@gmail.com</a>','Join CFSAC','','inherit','closed','closed','','75-revision-v1','','','2017-12-03 18:43:30','2017-12-03 18:43:30','',75,'http://www.cfsac.co.uk/75-revision-v1/',0,'revision','',0),(669,4,'2017-12-03 19:26:33','2017-12-03 19:26:33','<strong>21<sup>st</sup> & 22<sup>nd</sup> April (2 day)  Portland</strong> \r\n\r\nSkindeep operating out of Osprey Marina. Very roomy, comfortable and stable with plenty of shelter in case of bad weather. We usually come back to the Marina between dives. Example dives are Cragside, Lulworth Banks, Countess of Erne and James Fennel. Max 12 divers. Boat fees 54 per day. May be able to take a limited number of Ocean Divers. Basic accommodation at Margarets Bunkhouse on the roundabout just over the causeway to Portland. Cost approx. 23 pn. Great drying room and plenty of space. \r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','April  2018  Portland','','publish','closed','closed','','april-2018-portland','','','2018-02-03 12:05:57','2018-02-03 12:05:57','',0,'http://www.cfsac.co.uk/?p=669',0,'post','',0),(670,4,'2017-12-03 18:54:58','2017-12-03 18:54:58','<strong>22<sup>nd</sup> & 23<sup>rd</sup> September (2 day)  Littlehampton</strong>\r\n\r\nCharter boat Our Joy. New boat for the club. \r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','September  2018  Littlehampton','','publish','closed','closed','','september-2018-littlehampton','','','2017-12-08 10:02:58','2017-12-08 10:02:58','',0,'http://www.cfsac.co.uk/?p=670',0,'post','',0),(671,4,'2017-12-03 18:54:58','2017-12-03 18:54:58','<strong>22<sup>nd</sup> & 23<sup>rd</sup> September (2 day) (or 29/30th)  Littlehampton</strong>\r\n\r\nCharter boat Our Joy. New boat for the club. \r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','September  2018  Littlehampton','','inherit','closed','closed','','670-revision-v1','','','2017-12-03 18:54:58','2017-12-03 18:54:58','',670,'http://www.cfsac.co.uk/670-revision-v1/',0,'revision','',0),(672,4,'2017-12-03 19:04:45','2017-12-03 19:04:45','<strong>8<sup>th</sup> - 9<sup>th</sup> September (2 day)  Eastbourne</strong>\r\n\r\nCharter boat Dive125. Boat fees approx. 58 per day. Run by experienced divers, Dave Ronnan (Skipper and wreck enthusiast) and Sylvia Pryer (2nd Skipper, U/W Photographer and host). Compressor on board. New boat for the club. Looking to dive wrecks such as the Argonaut and Aulania.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','September  2018  Eastbourne','','publish','closed','closed','','september-2018-eastbourne','','','2017-12-03 19:04:45','2017-12-03 19:04:45','',0,'http://www.cfsac.co.uk/?p=672',0,'post','',0),(673,4,'2017-12-03 19:04:35','2017-12-03 19:04:35','','dive125','','inherit','closed','closed','','dive125-2','','','2017-12-03 19:04:35','2017-12-03 19:04:35','',672,'http://www.cfsac.co.uk/wp-content/uploads/2017/12/dive125.jpg',0,'attachment','image/jpeg',0),(674,4,'2017-12-03 19:04:45','2017-12-03 19:04:45','<strong>8<sup>th</sup> - 9<sup>th</sup> September (2 day)  Eastbourne</strong>\r\n\r\nCharter boat Dive125. Boat fees approx. 58 per day. Run by experienced divers, Dave Ronnan (Skipper and wreck enthusiast) and Sylvia Pryer (2nd Skipper, U/W Photographer and host). Compressor on board. New boat for the club. Looking to dive wrecks such as the Argonaut and Aulania.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','September  2018  Eastbourne','','inherit','closed','closed','','672-revision-v1','','','2017-12-03 19:04:45','2017-12-03 19:04:45','',672,'http://www.cfsac.co.uk/672-revision-v1/',0,'revision','',0),(675,4,'2017-12-03 19:08:55','2017-12-03 19:08:55','<strong>18<sup>th</sup> - 25<sup>th</sup> August (6 day)  Scillies</strong>\r\n\r\nAccommodation is on shore - Saturday check in and check out\r\n\r\nWe will spend 6 days diving the Scillies (Sunday to Friday). The diving is extremely varied  deep and shallow wrecks, an historical wreck  the Colossus, beautiful walls, and an opportunity to dive or snorkel with very friendly seals. The boat goes out for the whole day and returns to St Marys late afternoon.\r\n\r\nIndication of costs:\r\n\r\nDiving 230; Accommodation Self catering 200-250, share of ferry container 20; air 45 (there is currently no cylinder hire). Total: approx. 500. Food and travel extra.\r\n\r\nYou will need to book your own travel. The return ferry from Penzance is around 130 or you can travel by plane from various locations. A return flight from Exeter was 300 this year, flights from Newquay or Penzance would be cheaper. If sailing, the best option is to drive down and park at one of the long stay carparks in or just outside of Penzance. \r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','August  2018  Scillies','','publish','closed','closed','','august-2018-scillies','','','2018-02-03 11:55:19','2018-02-03 11:55:19','',0,'http://www.cfsac.co.uk/?p=675',0,'post','',0),(676,4,'2017-12-03 19:08:55','2017-12-03 19:08:55','<strong>18<sup>th</sup> - 26<sup>rd</sup> August (6 day)  ?</strong>\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','August  2018  ?','','inherit','closed','closed','','675-revision-v1','','','2017-12-03 19:08:55','2017-12-03 19:08:55','',675,'http://www.cfsac.co.uk/675-revision-v1/',0,'revision','',0),(677,4,'2017-12-03 19:14:21','2017-12-03 19:14:21','<strong>28<sup>th</sup> - 29<sup>th</sup> July (2 day)  Weymouth</strong>\r\n\r\nBoat is Tango  very roomy and comfortable and stable with plenty of shelter in case of bad weather. A new boat and skipper for the club. Boat costs 54 per day. There is the option to stay on the boat for 10 per night  one roomy cabin with electricity sleeps 6 -bring towels and sleeping bags. ','July  2018  Weymouth','','publish','closed','closed','','july-2018-weymouth','','','2017-12-04 17:35:56','2017-12-04 17:35:56','',0,'http://www.cfsac.co.uk/?p=677',0,'post','',0),(678,4,'2017-12-03 19:11:39','2017-12-03 19:11:39','<strong>28<sup>th</sup> - 29<sup>th</sup> July (2 day)  Weymouth</strong>\n\nBoat is Tango  very roomy and comfortable and stable with plenty of shelter in case of bad weather. A new boat and skipper for the club. Boat costs 54 per day. There is the option to stay on the boat for 10 per night  one roomy cabin with electricity sleeps 6 -bring towels and sleeping bags. ','August  2017  Weymouth','','inherit','closed','closed','','612-autosave-v1','','','2017-12-03 19:11:39','2017-12-03 19:11:39','',612,'http://www.cfsac.co.uk/612-autosave-v1/',0,'revision','',0),(679,4,'2017-12-03 19:14:14','2017-12-03 19:14:14','','tango','','inherit','closed','closed','','tango','','','2017-12-03 19:14:14','2017-12-03 19:14:14','',677,'http://www.cfsac.co.uk/wp-content/uploads/2017/12/tango.jpg',0,'attachment','image/jpeg',0),(680,4,'2017-12-03 19:14:21','2017-12-03 19:14:21','<strong>5<sup>th</sup> - 6<sup>th</sup> August (2 day)  Weymouth</strong>\r\n\r\nBoat is Tango  very roomy and comfortable and stable with plenty of shelter in case of bad weather. A new boat and skipper for the club. Boat costs 54 per day. There is the option to stay on the boat for 10 per night  one roomy cabin with electricity sleeps 6 -bring towels and sleeping bags. ','July  2018  Weymouth','','inherit','closed','closed','','677-revision-v1','','','2017-12-03 19:14:21','2017-12-03 19:14:21','',677,'http://www.cfsac.co.uk/677-revision-v1/',0,'revision','',0),(681,4,'2017-12-03 19:16:03','2017-12-03 19:16:03','<strong>7<sup>th</sup> - 8<sup>th</sup> July (2 day)  Lyme Regis</strong>\r\n\r\nDive Boat is Blue Turtle. Lovely easy going skipper. Maximum divers is 10. Boat fees 48 per day. A variety of diving  some great shallow wrecks like the Baygitano and the 