outh Yacht Haven, Mountbatten Centre. Boat costs are 52.50 per day. Max. 10 divers. The diving is well worth the trip down the M5. Accommodation will be B&B for Friday and Saturday night in the region of 30 pn.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','June  2018  Plymouth','','publish','closed','closed','','june-2018-plymouth','','','2017-12-03 19:19:37','2017-12-03 19:19:37','',0,'http://www.cfsac.co.uk/?p=683',0,'post','',0),(684,4,'2017-12-03 19:19:37','2017-12-03 19:19:37','<strong>23<sup>rd</sup>  24<sup>th</sup> June (2 days)  Plymouth</strong>\r\n\r\nAbyss hardboat operates out of Plymouth Yacht Haven, Mountbatten Centre. Boat costs are 52.50 per day. Max. 10 divers. The diving is well worth the trip down the M5. Accommodation will be B&B for Friday and Saturday night in the region of 30 pn.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','June  2018  Plymouth','','inherit','closed','closed','','683-revision-v1','','','2017-12-03 19:19:37','2017-12-03 19:19:37','',683,'http://www.cfsac.co.uk/683-revision-v1/',0,'revision','',0),(686,4,'2017-12-03 19:23:07','2017-12-03 19:23:07','<strong>30<sup>th</sup> May - 2<sup>nd</sup> June (2 day)  Pembroke</strong>\r\n\r\nBoat fees 50 per day\r\n\r\nAccommodation Bunk house accommodation or camping\r\n\r\nNB. Puffin season on Skomer. Day trips across to Skomer to see the puffins really close for non-divers and divers wanting to spend a bit more time in the area.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','May - 2018 - Pembroke','','publish','closed','closed','','may-2018-pembroke','','','2018-02-03 11:59:54','2018-02-03 11:59:54','',0,'http://www.cfsac.co.uk/?p=686',0,'post','',0),(687,4,'2017-12-03 19:23:07','2017-12-03 19:23:07','<strong>26<sup>th</sup> - 27<sup>th</sup> (2 day) (or 2/3rd June)  Pembroke</strong>\r\n','May - 2018 - Pembroke','','inherit','closed','closed','','686-revision-v1','','','2017-12-03 19:23:07','2017-12-03 19:23:07','',686,'http://www.cfsac.co.uk/686-revision-v1/',0,'revision','',0),(688,4,'2017-12-03 19:25:00','2017-12-03 19:25:00','<strong>5<sup>th</sup> - 6<sup>th</sup> (2 day)  Swanage</strong>\r\n\r\nCharter boat Vyper. Can take 12 divers. Boat comes back to the pier between dives but you can leave kit on between dives. Very easy loading. Boat is approx. 500 per day. I will book B&amp;B or bunkhouse accommodation unless anyone wishes to camp.\r\n\r\nDetails of campsites available:\r\nTom\'s Field <a title=\"Tom\'s Field\" href=\"www.tomsfieldcamping.co.uk/index.html\" target=\"_blank\">www.tomsfieldcamping.co.uk/index.html</a> BH19 3HN\r\nBurnbake campsite <a title=\"Burnbake campsite\" href=\"www.burnbake.com\" target=\"_blank\">www.burnbake.com</a> BH20 5JH\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','May - 2018 - Swanage','','publish','closed','closed','','may-2018-swanage','','','2018-02-03 12:06:11','2018-02-03 12:06:11','',0,'http://www.cfsac.co.uk/?p=688',0,'post','',0),(689,4,'2017-12-03 19:25:00','2017-12-03 19:25:00','<strong>5<sup>th</sup> - 6<sup>th</sup> (2 day)  Swanage</strong>\r\n\r\nCharter boat Vyper. Can take 12 divers. Boat comes back to the pier between dives but you can leave kit on between dives. Very easy loading. Boat is approx. 500 per day. I will book B&amp;B or bunkhouse accommodation unless anyone wishes to camp.\r\n\r\nDetails of campsites available:\r\nTom\'s Field <a title=\"Tom\'s Field\" href=\"www.tomsfieldcamping.co.uk/index.html\" target=\"_blank\">www.tomsfieldcamping.co.uk/index.html</a> BH19 3HN\r\nBurnbake campsite <a title=\"Burnbake campsite\" href=\"www.burnbake.com\" target=\"_blank\">www.burnbake.com</a> BH20 5JH','May - 2018 - Swanage','','inherit','closed','closed','','688-revision-v1','','','2017-12-03 19:25:00','2017-12-03 19:25:00','',688,'http://www.cfsac.c