s like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). However a new skipper may have some new sites! Im looking into booking a new B&amp;B as our regular place has stopped.\r\n\r\n&nbsp;','July - 2013 - Lyme Regis','','inherit','closed','closed','','229-revision-v1','','','2017-12-04 16:31:05','2017-12-04 16:31:05','',229,'http://www.cfsac.co.uk/229-revision-v1/',0,'revision','',0),(728,4,'2017-12-04 16:31:19','2017-12-04 16:31:19','<strong>5<sup>th</sup> &amp; 6<sup>th</sup></strong><strong> </strong><strong>July (2 day)  Lyme Regis</strong>\r\n\r\nHoping for the same fantastic weather we had last year. Lovely easy going skipper on board the Blue Turtle. Maximum number of divers on this trip is 10. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation at Devonia and possibly Charnwood as last year (or camping option).\r\n\r\n&nbsp;','July - 2014 - Lyme Regis','','inherit','closed','closed','','332-revision-v1','','','2017-12-04 16:31:19','2017-12-04 16:31:19','',332,'http://www.cfsac.co.uk/332-revision-v1/',0,'revision','',0),(729,4,'2017-12-04 16:31:38','2017-12-04 16:31:38','<strong>2<sup>nd</sup> and 3<sup>rd</sup> August (2 day)  Lyme Regis</strong>\r\n\r\nSame trip details as above trip. Dive Boat is Blue Turtle. Lovely easy going skipper. Maximum number of divers is 10. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation tbc  may be self catering (or camping option).\r\n\r\n&nbsp;','August - 2014 - Lyme Regis','','inherit','closed','closed','','340-revision-v1','','','2017-12-04 16:31:38','2017-12-04 16:31:38','',340,'http://www.cfsac.co.uk/340-revision-v1/',0,'revision','',0),(730,4,'2017-12-04 16:31:46','2017-12-04 16:31:46','<strong>18<sup>th</sup> - 19<sup>th</sup> (2 day)  Lyme Regis</strong>\r\n\r\nDive Boat is Blue Turtle. Lovely easy going skipper. Maximum number of divers is 10. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation tbc but plenty of variety  B&amp;B, bunkhouse or camping.','July - 2015 - Lyme Regis','','inherit','closed','closed','','437-revision-v1','','','2017-12-04 16:31:46','2017-12-04 16:31:46','',437,'http://www.cfsac.co.uk/437-revision-v1/',0,'revision','',0),(731,4,'2017-12-04 16:31:57','2017-12-04 16:31:57','<strong>8<sup>th</sup> - 9<sup>th</sup> July (2 day)  Lyme Regis</strong>\r\n\r\nDive Boat is Blue Turtle. Lovely easy going skipper. Maximum divers is 10. Boat fees 48 per day. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation tbc but plenty of variety  B&B, bunkhouse or camping. If you wish to camp please book your own camping. Here is one campsite we have used.\r\n\r\nCannington Farm, Uplyme, DT7 3SW 01297443172 <a href=\"http://www.canningtonfarm.co.uk/CanningtonCampsite.htm\">http://www.canningtonfarm.co.uk/CanningtonCampsite.htm</a>\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','July  2017  Lyme Regis','','inherit','closed','closed','','614-revision-v1','','','2017-12-04 16:31:57','2017-12-04 16:31:57','',614,'http://www.cfsac.co.uk/614-revision-v1/',0,'revision','',0),(732,4,'2017-12-04 16:32:06','2017-12-04 16:32:06','<strong>16<sup>th</sup> - 17<sup>th</sup> (2 day)  Lyme Regis</strong>\r\n\r\nDive Boat is Blue Turtle. Lovely easy going skipper. Maximum number of divers is 10. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation tbc but plenty of variety  B&B, bunkhouse or camping.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','July - 2016 - Lyme Regis','','inherit','closed','closed','','496-revision-v1','','','2017-12-04 16:32:06','2017-12-04 16:32:06','',496,'http://www.cfsac.co.uk/496-revision-v1/',0,'revision','',0),(733,4,'2017-12-04 16:32:21','2017-12-04 16:32:21','<strong>7<sup>th</sup> - 8<sup>th</sup> July (2 day)  Lyme Regis</strong>\r\n\r\nDive Boat is Blue Turtle. Lovely easy going skipper. Maximum divers is 10. Boat fees 48 per day. A variety of diving  some great shallow wrecks like the Baygitano and the Heroine and also some deeper ones (Aeolian Sky and Moidart) and some great drifts (Sawtooth ledges). A good lift at the back of the boat. Accommodation tbc but plenty of variety  B&B, bunkhouse or camping. If you wish to camp please book your own camping. Here is one campsite we have used.\r\n\r\nCannington Farm, Uplyme, DT7 3SW 01297443172 <a href=\"http://www.canningtonfarm.co.uk/CanningtonCampsite.htm\">http://www.canningtonfarm.co.uk/CanningtonCampsite.htm</a>\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','July  2018  Lyme Regis','','inherit','closed','closed','','681-revision-v1','','','2017-12-04 16:32:21','2017-12-04 16:32:21','',681,'http://www.cfsac.co.uk/681-revision-v1/',0,'revision','',0),(735,4,'2017-12-04 17:35:56','2017-12-04 17:35:56','<strong>28<sup>th</sup> - 29<sup>th</sup> July (2 day)  Weymouth</strong>\r\n\r\nBoat is Tango  very roomy and comfortable and stable with plenty of shelter in case of bad weather. A new boat and skipper for the club. Boat costs 54 per day. There is the option to stay on the boat for 10 per night  one roomy cabin with electricity sleeps 6 -bring towels and sleeping bags. ','July  2018  Weymouth','','inherit','closed','closed','','677-revision-v1','','','2017-12-04 17:35:56','2017-12-04 17:35:56','',677,'http://www.cfsac.co.uk/677-revision-v1/',0,'revision','',0),(737,4,'2017-12-08 10:02:33','2017-12-08 10:02:33','<strong>30<sup>th</sup> May - 2<sup>nd</sup> June (2 day)  Pembroke</strong>\r\n','May - 2018 - Pembroke','','inherit','closed','closed','','686-revision-v1','','','2017-12-08 10:02:33','2017-12-08 10:02:33','',686,'http://www.cfsac.co.uk/686-revision-v1/',0,'revision','',0),(738,4,'2017-12-08 10:02:58','2017-12-08 10:02:58','<strong>22<sup>nd</sup> & 23<sup>rd</sup> September (2 day)  Littlehampton</strong>\r\n\r\nCharter boat Our Joy. New boat for the club. \r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','September  2018  Littlehampton','','inherit','closed','closed','','670-revision-v1','','','2017-12-08 10:02:58','2017-12-08 10:02:58','',670,'http://www.cfsac.co.uk/670-revision-v1/',0,'revision','',0),(740,4,'2018-02-03 11:54:05','2018-02-03 11:54:05','<strong>18<sup>th</sup> - 25<sup>th</sup> August (6 day)  Scillies</strong>\n\nAccommodation is on shore - Saturday check in and check out\n\nWe will spend 6 days diving the Scillies (Sunday to Friday). The diving is extremely varied  deep and shallow wrecks, an historical wreck  the Colossus, beautiful walls, and an opportunity to dive or snorkel with very friendly seals. The boat goes out for the whole day and returns to St Marys late afternoon.\n\nThe trip is open to Sports Divers and above. As usual with club trips you must undertake to complete a sheltered water dive before the trip (Stoney Cove dates and the full schedule will be sent late November).\n\nIndication of costs:\n\nDiving 230; Accommodation Self catering 200-250, share of ferry container 20; air 45 (there is currently no cylinder hire). Total: approx. 500. Food and travel extra.\n\nYou will need to book your own travel. The return ferry from Penzance is around 130 or you can travel by plane from various locations. A return flight from Exeter was 300 this year, flights from Newquay or Penzance would be cheaper. If sailing, the best option is to drive down and park at one of the long stay carparks in or just outside of Penzance. \n\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','August  2018  ?','','inherit','closed','closed','','675-autosave-v1','','','2018-02-03 11:54:05','2018-02-03 11:54:05','',675,'http://www.cfsac.co.uk/675-autosave-v1/',0,'revision','',0),(741,4,'2018-02-03 11:55:19','2018-02-03 11:55:19','<strong>18<sup>th</sup> - 25<sup>th</sup> August (6 day)  Scillies</strong>\r\n\r\nAccommodation is on shore - Saturday check in and check out\r\n\r\nWe will spend 6 days diving the Scillies (Sunday to Friday). The diving is extremely varied  deep and shallow wrecks, an historical wreck  the Colossus, beautiful walls, and an opportunity to dive or snorkel with very friendly seals. The boat goes out for the whole day and returns to St Marys late afternoon.\r\n\r\nIndication of costs:\r\n\r\nDiving 230; Accommodation Self catering 200-250, share of ferry container 20; air 45 (there is currently no cylinder hire). Total: approx. 500. Food and travel extra.\r\n\r\nYou will need to book your own travel. The return ferry from Penzance is around 130 or you can travel by plane from various locations. A return flight from Exeter was 300 this year, flights from Newquay or Penzance would be cheaper. If sailing, the best option is to drive down and park at one of the long stay carparks in or just outside of Penzance. \r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','August  2018  Scillies','','inherit','closed','closed','','675-revision-v1','','','2018-02-03 11:55:19','2018-02-03 11:55:19','',675,'http://www.cfsac.co.uk/675-revision-v1/',0,'revision','',0),(742,4,'2018-02-03 12:04:37','2018-02-03 12:04:37','<strong>18<sup>th</sup> & 20<sup>th</sup> May (3 day)  St Abbs</strong> \r\n\r\nShore Diver. New boat for the club. Run by www.divestabbs.com. Compressor on site. but not on the boat\r\n\r\nBoat fees 40 per day\r\n\r\nAccommodation 3 nights B&B or self catering tbc approx. cost 25-30 per night. Check in Thursday check out Sunday\r\n\r\nNB. Bring two cylinders\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','May - 2018 - St Abbs','','publish','closed','closed','','may-2018-st-abbs','','','2018-02-03 12:04:37','2018-02-03 12:04:37','',0,'http://www.cfsac.co.uk/?p=742',0,'post','',0),(743,4,'2018-02-03 11:57:57','2018-02-03 11:57:57','<strong>30<sup>th</sup> May - 2<sup>nd</sup> June (2 day)  Pembroke</strong>\r\n\r\nBoat fees 50 per day\r\n\r\nAccommodation Bunk house accommodation or camping\r\n\r\nNB. Puffin season on Skomer. Day trips across to Skomer to see the puffins really close for non-divers and divers wanting to spend a bit more time in the area.','May - 2018 - Pembroke','','inherit','closed','closed','','686-revision-v1','','','2018-02-03 11:57:57','2018-02-03 11:57:57','',686,'http://www.cfsac.co.uk/686-revision-v1/',0,'revision','',0),(744,4,'2018-02-03 11:58:53','2018-02-03 11:58:53','<strong>5<sup>th</sup> - 6<sup>th</sup> (2 day)  Swanage</strong>\r\n\r\nCharter boat Vyper. Can take 12 divers. Boat comes back to the pier between dives but you can leave kit on between dives. Very easy loading. Boat is approx. 500 per day. I will book B&amp;B or bunkhouse accommodation unless anyone wishes to camp.\r\n\r\nDetails of campsites available:\r\nTom\'s Field <a title=\"Tom\'s Field\" href=\"www.tomsfieldcamping.co.uk/index.html\" target=\"_blank\">www.tomsfieldcamping.co.uk/index.html</a> BH19 3HN\r\nBurnbake campsite <a title=\"Burnbake campsite\" href=\"www.burnbake.com\" target=\"_blank\">www.burnbake.com</a> BH20 5JH\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','May - 2018 - Swanage','','inherit','closed','closed','','688-revision-v1','','','2018-02-03 11:58:53','2018-02-03 11:58:53','',688,'http://www.cfsac.co.uk/688-revision-v1/',0,'revision','',0),(745,4,'2018-02-03 11:59:54','2018-02-03 11:59:54','<strong>30<sup>th</sup> May - 2<sup>nd</sup> June (2 day)  Pembroke</strong>\r\n\r\nBoat fees 50 per day\r\n\r\nAccommodation Bunk house accommodation or camping\r\n\r\nNB. Puffin season on Skomer. Day trips across to Skomer to see the puffins really close for non-divers and divers wanting to spend a bit more time in the area.\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','May - 2018 - Pembroke','','inherit','closed','closed','','686-revision-v1','','','2018-02-03 11:59:54','2018-02-03 11:59:54','',686,'http://www.cfsac.co.uk/686-revision-v1/',0,'revision','',0),(746,4,'2018-02-03 12:04:27','2018-02-03 12:04:27','','G0042724-Small-768x432','','inherit','closed','closed','','g0042724-small-768x432','','','2018-02-03 12:04:27','2018-02-03 12:04:27','',742,'http://www.cfsac.co.uk/wp-content/uploads/2018/02/G0042724-Small-768x432.jpg',0,'attachment','image/jpeg',0),(747,4,'2018-02-03 12:04:37','2018-02-03 12:04:37','<strong>18<sup>th</sup> & 20<sup>th</sup> May (3 day)  St Abbs</strong> \r\n\r\nShore Diver. New boat for the club. Run by www.divestabbs.com. Compressor on site. but not on the boat\r\n\r\nBoat fees 40 per day\r\n\r\nAccommodation 3 nights B&B or self catering tbc approx. cost 25-30 per night. Check in Thursday check out Sunday\r\n\r\nNB. Bring two cylinders\r\n\r\n<span style=\"text-decoration: underline;\">This is a trip for Sports Divers &amp; above</span>.','May - 2018 - St Abbs','','inherit','closed','closed','','742-revision-v1','','','2018-02-03 12:04:37','2018-02-03 12:04:37','',742,'http://www.cfsac.co.uk/742-revision-v1/',0,'revi